13	Donald J. Wernick Academic Achievement Award	Mary Bridgeman	7329252356	mary.bridgeman@pharmacy.rutgers.edu	Mary Bridgeman	665 Harrell Avenue, Woodbridge, NJ 07095	7329252356	mary.bridgeman@pharmacy.rutgers.edu	Clinical Associate Professor, Ernest Mario School of Pharmacy, Rutgers, The State University of New Jersey	2014-06-25 20:47:31.548417	2014-06-25 20:47:31.548417	Curriculum_Vitae_-_Mary_Bridgeman_June_2014.pdf	application/pdf	329040	2014-06-25 20:47:31.526783	Mary is an outstanding professor and academician, maintaining a practice as a Clinical Pharmacist specializing in Adult Internal Medicine at Robert Wood Johnson University Hospital in New Brunswick, New Jersey and serving as a Clinical Associate Professor at the Ernest Mario School of Pharmacy at Rutgers, The State University of New Jersey.  Mary serves as course coordinator and instructor in the Self Care and Home Care and Concepts in Pharmacy Practice courses at the pharmacy school, in addition to providing lectures on kidney disease in the therapeutics modules.  She is responsible for the training and academic growth and development of the students she precepts on rotation as well as in the classroom at the school.  In addition to these activities, at the local level, she is actively engaged with the New Jersey Pharmacist’s Association as well as the New Jersey Society of Health-Systems Pharmacists.  She has presented numerous continuing education presentations to pharmacists and pharmacy technician members of both organizations.  On a regional level, as a trainer for the American Pharmacist’s Association’s Pharmacy-Based Immunization Delivery Program, she has trained over 2,000 pharmacists and pharmacy students to become immunizers.  On a national level, she is actively involved with the American Society of Health-Systems Pharmacists by serving as a preliminary round judge for the National Clinical Skills Competition, an annual event.  Mary is recognized as a Board Certified Pharmacotherapy Specialist and Certified Geriatric Pharmacist.  	\N
