36	Independent Pharmacist of the Year Award	Alan S. Aronovitz, Acting Chairman Region 5 Awards Committee	609-823-8309	asaxpcs@aol.com	Mark Taylor	503 S 4th Ave, Galloway, NJ 08205	609-892-0301	mark@jspharmacy.com	Owner Jersey Shore Pharmacy	2014-07-15 03:21:00.59548	2014-07-15 03:21:00.59548	JSP_Bio_07092014.doc	application/octet-stream	288256	2014-07-15 03:21:00.570962	While patients can get their manufactured medication from any pharmacy, Mark Taylor has had the vision to help his patients solve their individual medical needs by compounding unique dosage forms at his Jersey Shore Pharmacy in Egg Harbor Township, NJ.  Listening carefully to his patients and then consulting with their prescriber, Mark and his team can develop customized medication solutions that meet the health objectives of both people and pets. And while compounding pharmacy has had some unfortunate mishaps recently, Mark is committed to a standard of high quality. Employing state of the art equipment and testing, Jersey Shore Pharmacy recently attained accreditation by the Pharmacy Compounding Accreditation Board (PCAB) for sterile and non-sterile compounding. PCAB accreditation gives patients, prescribers, and payers a way to select a pharmacy that meets or exceeds USP’s high quality standards. They are one of only eight pharmacies in New Jersey that are PCAB accredited.  Professionally, Mark is a member of half a dozen pharmacy organizations as well as serving as Treasurer and Trustee for NJPhA Region 5.  He also serves as a preceptor for all the area pharmacy colleges. I recommend visiting the Jersey Shore Pharmacy website at http://www.jspharmacy.com/ for a truly impressive list of accomplishments and ways in which Mark's team is serving their patients. 	\N
37	Donald J. Wernick Academic Achievement Award	Moriah Weissman	2013150730	moriahjaye@gmail.com	Maria Leibfried		201 401 2304	leibfrim@stjohns.edu		2014-07-15 18:17:19.476641	2014-07-15 18:17:19.476641	\N	\N	\N	\N	 Maria is an amazingly well-rounded pharmacist.  She is an active participant in NJPhA, St. John's, her home church and her daughters’ cheerleading teams.  As a leader in NJPhA, she is the co-chair of the Journal committee; while in this role, she implemented the pharmacy practice spotlight (serving as the panel at this year’s convention), improved the perception of the Journal by implementing peer-review.  In addition to her role as co-chair, she implemented one of the only official student chapters of NJPhA (at St. John’s).  As the advisor of this chapter, she has led her students to become more active in NJPhA, plan bake sales to raise money to fund a bus to convention and they are planning to run a law review for students taking the NJ exam (as it is not currently offered at St. John’s).   She is a dedicated profession who is most deserving of this award – additional details can be found in her resume, attached.\r\n\r\nSigned,\r\nMoriah Weissman\r\n	\N
