40	NASPA Excellence in Innovation Award\r\nSponsored by Upsher-Smith	Sandra Moore	609-651-1255	scmoorerp@yahoo.com	Chester Lau	Capital Health Regional Medical Center and Capital Health Medical Center - Hopewell	609-815-7656	CLau@capitalhealth.org	Director of Pharmacy	2015-03-05 18:07:59.385593	2015-03-05 18:07:59.385593	Chester_Lau_nomination_NASPA_award.docx	application/vnd.openxmlformats-officedocument.wordprocessingml.document	17245	2015-03-05 18:07:59.306974	Chester Lau is the current Director of Pharmacy at Capital Health Regional Medical Center and Capital Health Medical Center – Hopewell, NJ.  In addition to developing a Pharmacy Residency Program (PGY-1) at Capital Health in 2011, Chester developed and initiated the Mini-Residency (Knights Scholar) program with Rutgers University, EMSOP in 2014 which now expands to 3 NJ hospitals in 2015.  The program began 1/2014 with 4 students participating from 5/2014 to 12/2014. St. Barnabas and Hunterdon Hospitals have decided to implement the program at their hospitals.  There will be 9 Knight Scholars participating in the program for 2015 (4 at Capital Health, 3 at Barnabas and 2 at Hunterdon).   \r\nThe intent of the program is to develop scholarship, service, and leadership in motivated PharmD candidates through a diversified block of advanced pharmacy practice experiences (APPE) in a health-system environment.  Upon completion of the program, the KNIGHT ScholarRx student will have gained: (1) knowledge and skills necessary to function as an active member of the healthcare team; (2) a network of preceptors, practitioners and P4 students who can support his/her student and professional career; (3) innovative experiences that will prepare him/her for success in a postgraduate training program.  In addition to their standard APPE rotation requirements, the scholars, at a minimum, will complete a research project (publication or presentation) – IRB process, good clinical practice guidelines, and the Collaborative Institutional Training Initiative (CITI); participate in a community project in collaboration with other KNIGHT ScholaRx students; present one formal patient case, journal club, and drug information activity during each clinical APPE.\r\nEach KNIGHT ScholaRx is scheduled to complete 4 X 5 week blocks out of their APPE blocks covering internal medicine, infectious disease, critical care and hospital practice.  Their patient care roles include discharge counseling, medication reconciliation, antimicrobial stewardship (IV to PO, kinetic monitoring) and target drug monitoring.\r\nChester has also initiated an annual  meeting  for residents to present their research projects prior to the Eastern State Conference held each year in May.  The purpose is for the residents to practice their presentations prior to the conference and also to showcase their talents.  The invitation is sent to area DOP’s with residency programs.\r\nIt is of my opinion this program enhances the training and practice experience of the students which will enhance patient care.  The data from their interventions supports improving quality of care of the patient and their outcomes.  Chester is very committed to developing our young practitioners to focus on the care our patients receive.\r\nSandra Moore, PharmD\r\nCV for Chester Lau is attached\r\n	\N
