.  She is also a Media Specialist and Advisor, has written for and is serving the Editorial Advisory Panel of Pharmacy Times, served as Senior Advisor to a major New York health care public relations firm, and has received numerous awards for her professional work.  \r\n\r\nDonna received her Bachelor of Science Degree in Pharmacy from the Massachusetts College of Pharmacy and Health Sciences and her Bachelor of Arts Degree in Communication from Douglass College at Rutgers University.  She has most recently worked as Consumer Safety Officer at the Food and Drug Administration, Center for Drugs and Evaluation and Research, Office of Training and Communication, Division of Drug Information.  She is a Pharmacist volunteer for the National Association of Free Clinics, where she offers free drug consultation services to the public, most recently at the Washington, DC free clinic in August, 2010.  She is also serving as a Lector and an Extraordinary Minister of Holy Communion at the Basilica of the National Shrine of the Immaculate Conception in Washington, DC and as a volunteer with the Franciscan Monastery Garden Guild.  Donna’s broad-based experience in the industry, community, managed care, clinical pharmacy and government areas over 20 years, has enabled her to merge her skills in business management and organization with her extensive knowledge of the pharmaceutical industry and profession.	\N
