85	William H. McNeill Award	Marlene Peterson	(973) 539-8210	MPete8210@aol.com	Marlene Peterson  RPh	33 & 1/2 Manger Road, Cedar Knolls, NJ 07927	(973) 539-8210	MPete8210@aol.com	Registered Pharmacist	2016-06-03 21:30:41.29341	2016-06-03 21:30:41.29341	\N	\N	\N	\N	Marlene Peterson  is a registered pharmacist who  retired 3 years ago after 44 years of serving as a  pharmacist in the community practice.\r\n\r\nUpon her retirement she approached the Officials of the Board of Health in Hanover Township, NJ ( her home municipality) to begin a Pharmacy Brown Bag Program serving the needs of the community. The program was initiated in 2014 and sponsored by the Health Department.  It is held on a one-to-one 45 minute session, and Marlene has been responsible , through this program of creating an awareness of the community in the need of their understanding of their drug regimens, side effect, interactions, etc. Also the patient is free to ask any questions about their medications. The community has benefited from this since, in many cases, their dispensing pharmacist does not have the time to counsel properly. This has been a tremendous success in Hanover especially with the senior citizens who represent the majority of polypharmacy patients. Marlene has adopted the same program in Morris Township . She has seen over 40 patients during these two years. She has addressed  town senior citizen groups on the topics of Drug Safety and Proper Disposal\r\n\r\nMarlene subsequently has been appointed as a member of the Board of Health in Hanover Township, again serving the community in a monumental way.\r\nShe has given of herself in all aspects of these activities while at the same time using her pharmacy professional knowledge to 'give back'.\r\nThese facts support her consideration  for the William H. McNeill Award\r\nMarlene has been a member of the NJPhA for 40 years and has served as the President of the Morris-Susses Pharmacists. 	\N
