108	William H. McNeill Award	Marlene Peterson		MPete8210@aol.com	Marlene Peterson  RPh	33 & 1/2 Manger Road, Cedar Knolls, NJ 07927	(973) 539-8210	MPete8210@aol.com	Registered Pharmacist	2016-06-06 18:29:19.572824	2016-06-06 18:29:19.572824	\N	\N	\N	\N	Marlene Peterson is a registered pharmacist who retired 3 years ago after 44 years of serving as a pharmacist in the community setting. Upon her retirement she approached the officials of the Board of Health  in the Township of Hanover ( her home municipality)  to ask if she could begin a Pharmacy Brown Bag Program serving the needs of the community. . The program was then initiated  in  2014 , sponsored by the Health Department and  directed by Marlene.\r\n\r\nEach session is held on a 1 to 1 basis and lasts 45 minutes.  Marlene has been responsible, through the program, for creating an awareness in the community for each individual  regarding the understanding of their drug regimen, side effects, interactions  and proper timing and disposal of medications. The patients are free to address their questions and concerns about their medications to Marlene, too.\r\n\r\nThe community has benefited from this program, since in many cases, their dispensing pharmacist often does not have the time to counsel.  This has been a tremendous success in Hanover, especially with the senior citizen population who represent the majority of polypharmacy patients.\r\n\r\nMarlene has adopted the same program in Morris Township.  She has seen over 40 patients in the past 2 years. She also addressed town senior citizen groups on the topics of Drug Safety and Proper Disposal.\r\n\r\nSubsequently she has been appointed the the Board of Health in Hanover Township in 2016, again serving the community in a monumental way.\r\n\r\nMarlene has given of herself in all aspects of these activities while, at the same time, using her professional pharmacy knowledge to 'give back', never accepting any remuneration.  \r\n\r\nThe facts support her consideration for the William H. McNeill Award. \r\n\r\nShe has been a member of the NJPHA for 40 years and has served as the Past- President of the Morris Sussex Pharmacy Society.\r\n\r\nDate submitted  June 6, 2016	\N
