185	Bowl of Hygeia\r\nSponsored by APhA Foundation and NASPA	Maria Leibfried	201-447-8617	leibfried2@hotmail.com	Stephen Brickman		00000000	unknown@unknown.com	LTC (USA Retired), NJ-1 DMAT, Warren County Hazmat Team	2016-06-10 14:40:51.124888	2016-06-10 14:40:51.124888	\N	\N	\N	\N	Stephen is deserving of the Bowl of Hygeia because he is a NJ licensed pharmacist who has an outstanding record of community service that reflects well on the profession of pharmacy. Stephen owned a pharmacy and, in addition to pharmaceutical services, was a part of his community. He has served our country and the profession through his practice in the military and in the VA healthcare system. Additionally, he has been an active member of Disaster Medical Assistance Team (DMAT) since the early 1990's. He has gone above and beyond his role as a pharmacist to be a humanitarian by helping disaster victims, such as Hurricane Hugo victims, and refugees, such as Kosovo refugees in 1999. He represents our profession well in both pharmacy and nonpharmacy roles. He advocates for pharmacists to become involved in DMAT, and he was published in the Fall 2015 issue of our Journal, and spoke at NJPhA Convention in 2015.	\N
