292	Mortar & Pestle Award	Laurie Clark	732-213-0250	laurieclark@msn.com	Assemblyman Raj Mukherji	433 Palisade Avenue, Jersey City, NJ 07307	201-626-4000	AsmMukherji@njleg.og	Assemblyman - District 33	2017-07-12 23:05:42.373691	2017-07-12 23:05:42.373691	\N	\N	\N	\N	Recommendation for the NJPhA – Mortar and Pestle Award 2017\r\nSubmitted by Laurie A. Clark – Legislative Counsel\r\n\r\nAssemblyman Raj Mukherji (D) has represented the 33rd Legislative District since the year 2014.\r\nDespite the fact that he is one of the youngest members of the Legislature, his achievements are truly outstanding.   In terms of his importance to the profession of pharmacy, he is a member of the following committees:\r\n•\tAssembly Budget Committee\r\n•\tAssembly Commerce and Economic Development Committee\r\n•\tAssembly Labor Committee\r\nI have nominated him for this award because of his outstanding legislative record but most importantly for his work on the PBM Regulation Issues through sponsorship of the MAC Transparency Law, P.L. 2015, Chapter 179.  This law went into effect in April of 2016, and provided for the very first time that PBMs were placed under the jurisdiction of the New Jersey Department of Banking and Insurance. \r\nIn the current legislative session, he is the Co-Prime Sponsor of A-4676, entitled the “Prescription Drug Patient Protection Act” which will further regulate PBMS by  providing a solid regulatory structure for consumer protection under the Department of Banking and Insurance, and Prime Sponsor of A-5041 which prohibits a PBM from retroactively  deducting money on a clean claim either directly or indirectly on any pharmacy claim processed in this state effectively preventing any DIR type fees from being implemented in our state.\r\nThe Assemblyman is steadfastly committed to advancing the profession of pharmacy and to ensuring that PBMs are thoroughly regulated in New Jersey.    We are extremely fortunate to have an individual of his capabilities as a strong supporter.\r\nLink to official biography: http://www.njleg.state.nj.us/members/BIO.asp?Leg=364\r\nI have also attached a narrative biography. \r\n	\N
