82	Med Sync	med_sync	\N			<p><strong>ABM/Medication Synchronization Implementation</strong></p>\r\n\r\n<p>Set your pharmacy up for med sync success! Read on to learn more about the methods and infrastructure needed to successfully start and grow the ABM/medication synchronization in a community pharmacy setting.</p>\r\n\r\n<p>The APhA utilized consortium recommendations to refresh an ABM (medication synchronization) Implementation Guide, previously developed by the Alliance for Patient Medication Safety. The ABM Implementation Guide and accompanying customizable resources are available below and will help pharmacist and community pharmacy administration navigate through the process of integrating the ABM/medication synchronization into pharmacy workflow and business models.</p>\r\n\r\n<ul>\r\n\t<li><a href="http://www.aphafoundation.org/sites/default/files/ckeditor/files/ABMWhitePaper-FINAL-20130923%283%29.pdf">&quot;Pharmacy&#39;s Appointment Based Model: a Prescription Synchronization Program that Improves Adherence&quot;</a></li>\r\n\t<li><a href="http://www.aphafoundation.org/sites/default/files/ckeditor/files/ABMImplementationGuide-FINAL-20130923.pdf">Pharmacy&#39;s Appointment Based Model - Implementation Guide for Pharmacy Practices</a></li>\r\n</ul>\r\n\r\n<p>Customizable resources:</p>\r\n\r\n<ul>\r\n\t<li><a href="http://www.aphafoundation.org/sites/default/files/ckeditor/files/A6a-SamplePatientAgreement-20130717.docx">Sample patient agreement</a></li>\r\n\t<li><a href="http://www.aphafoundation.org/sites/default/files/ckeditor/files/A6b-Verification%20Request-20130717.xls">Verification request form</a></li>\r\n\t<li><a href="http://www.aphafoundation.org/sites/default/files/ckeditor/files/A6-PatientEnrollmentCard-Front-20131010.docx">Patient enrollment card (front)</a></li>\r\n\t<li><a href="http://www.aphafoundation.org/sites/default/files/ckeditor/files/A6-PatientEnrollmentCard-Back-20131010.docx">Patient enrollment card (back)</a></li>\r\n\t<li><a href