84	Zlotnick ELITE Master Educator	zlotnick_elite_master_educator	\N			<h1>June 2016 - Dr. Stephen Zlotnick Awarded the ELITE Master Educator Distinction by Genentech</h1>\r\n\r\n<p>Steve Zlotnick (PharmD), a long time NJPhA member, committee chair, trustee, and former president, has been awarded the ELITE Master Educator distinction by Genentech. His role as an MSL for his company and as a professor at the Philadelphia College of Pharmacy provide ample opportunities for him to share information and teach&mdash;often using analogies to illustrate the point &ndash; all in an effort to help patients.</p>\r\n	61	2016-07-27 19:46:12.052282	2016-07-27 19:53:57.499224	0	f	f	f		f	f		f
17	Regional Programs/Live CE	regional-programs	\N	pharmacy continuing ed, pharmacy ceu, pharmacy uan	NJPhA regions host live continuing education programs for pharmacists and pharmacy technicians. Continuing ed credits are available. Pharmacy students are also welcome. 	<h1>Live Continuing Education</h1>\r\n\r\n<p>The 6 regions that comprise NJPhA play critical roles by hosting several gatherings throughout the year, among them, continuing education programs. Association members can attend programs in any regions&mdash;not just those sessions hosted by your local chapter. In addition, NJPhA hosts several statewide programs each year.</p>\r\n\r\n<p>This page lists the programs scheduled in the near future. You can also use the {% link_pg link , false , , , 12 , Event Calendar %} to see what programs are being offered by the different regions. Continuing education programs are organized throughout the year, so if a region doesn&rsquo;t currently list upcoming programming, check back soon.&nbsp;<span style="line-height: 1.6;">&nbsp; &nbsp; &nbsp;</span></p>\r\n\r\n<hr />\r\n<p><strong style="line-height: 1.6;"><em>Please note</em>: &nbsp;</strong></p>\r\n\r\n<p>Cancellation Policy&nbsp;&ndash;&nbsp;If you need to cancel your registration, please notify NJPhA as soon as possible. Timely notification of a cancellation may allow another person to participate in your place. Seats are reserved. Registrants will receive a refund less a $10 processing fee per registration if canceled one week prior to the event date. No refund for cancellation will be issued once the program begins. All Refunds will be processed after the meeting.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/8/content_acpe.jpg" style="margin: 4px 3px; width: 50px; height: 50px; float: left;" /><span style="font-size: 12px;"> The New Jersey Pharmacists Association is accredited by the Accreditation Council for Pharmacy Education as a provider of continuing pharmacy education. Proof of your participation will be submitted to CPE Monitor within 60 days subject to documented attendance and completion of online evaluation materials.</span></em></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<hr />\r\n<h2><a id="Pharmacists &amp; Patient Centered Diabetes Care" name="Pharmacists &amp; Patient Centered Diabetes Care"></a>Register Now for Certificate Programs</h2>\r\n\r\n<p><strong>Pharmacy Based Immunization Delivery Certificate Training</strong></p>\r\n\r\n<p>The next program will be held June 11, 2016 in Freehold, NJ.&nbsp; See the <a href="http://njpharmacists.org/events#id=236&amp;cid=955&amp;wid=201&amp;type=Cal">Calendar of Events</a> for registration information</p>\r\n\r\n<p style="line-height: 20.8px;"><strong>Medication Therapy Management Certificate Training&nbsp;</strong></p>\r\n\r\n<p style="line-height: 20.8px;">This program will be offered on June 11, 2016 in Freehold,&nbsp; NJ</p>\r\n\r\n<p style="line-height: 20.8px;"><span style="line-height: 20.79px;">{% link_pg button, false, _self, btn-large,&nbsp;</span>http://njpharmacists.org/events#id=237&amp;cid=955&amp;wid=201&amp;type=Cal<span style="line-height: 20.79px;">,&nbsp;More Info &amp; Register %}</span></p>\r\n\r\n<p><span style="font-size: 16px;"><strong><span style="color: rgb(0, 0, 0); font-family: adelle-sans, helvetica, sans-serif; box-sizing: border-box;"><span style="line-height: 22.4px; box-sizing: border-box;">&nbsp;2016 schedule under development.&nbsp; Check back, view the calendar of events or call the office for updates. </span></span></strong></span></p>\r\n\r\n<hr />\r\n<h2><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/9/content_region_1.png" style="width: 100px; height: 94px; line-height: 1.2;" />&nbsp;&nbsp;<span style="line-height: 1.2;">Region 1</span></h2>\r\n\r\n<p>October 5, 2016</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">Seasons Catering and Special Events</p>\r\n\r\n<p