g></u></span></p>\r\n\r\n<p style="line-height: 20.8px;">June 15, 2016</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">Renault Winery Resort</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">Egg Harbor Township, New Jersey</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;"><span style="line-height: 20.79px;">{% link_pg button, false, _self, btn-large,&nbsp;</span>http://njpharmacists.org/events#id=253&amp;cid=955&amp;wid=201&amp;type=Cal<span style="line-height: 20.79px;">,&nbsp;More Info &amp; Register %}</span></p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">September 21, 2016</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">Renault Winery Resort</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">Egg Harbor Township, New Jersey</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;"><span style="line-height: 20.79px;">{% link_pg button, false, _self, btn-large,&nbsp;</span>http://njpharmacists.org/events#id=254&amp;cid=955&amp;wid=201&amp;type=Cal<span style="line-height: 20.79px;">,&nbsp;More Info &amp; Register %}</span></p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">November 9, 2016</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">Renault Winery Resort</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;">Egg Harbor Township, New Jersey</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 20.8px; box-sizing: border-box;"><span style="line-height: 20.79px;">{% link_pg button, false, _self, btn-large,</span>http://njpharmacists.org/events#id=255&amp;cid=955&amp;wid=201&amp;type=Cal<span style="line-height: 20.79px;">,&nbsp;More Info &amp; Register %}</span></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h2><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/14/content_region_6.png" style="width: 165px; height: 114px;" />&nbsp; Region 6</h2>\r\n\r\n<p>June 22, 2016</p>\r\n\r\n<p>Fibroids: Medical Management Options</p>\r\n\r\n<p>Cherry Hill, NJ</p>\r\n\r\n<p><span><b style="font-family: sans-serif;"><font size="4">Event Details:&nbsp; Save The Date</font></b></span></p>\r\n\r\n<p><span>Faculty: Chike Obianwu, MD, MBA, FACS, FACOG &nbsp;Assistant Clinical Professor Drexel University</span></p>\r\n\r\n<p><span>Director Alliance OB/GYN Consultants Cosmetic Gynecology &amp; Aesthetics</span></p>\r\n\r\n<p><span>6:00 PM - 7:00 PM - Registration, Networking &amp; Dinner</span></p>\r\n\r\n<p><span>7:00 PM - 8:30PM - CE Programming</span></p>\r\n\r\n<hr size="2" width="100%" />\r\n<p><span>Contact Hours: 1.5 (0.15 CEUs)&nbsp;</span></p>\r\n\r\n<p><span>UAN:&nbsp; 0136-0000-15-016-L04-P<span style="font-size: 10pt;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span></p>\r\n\r\n<div style="font-family: sans-serif;"><span>Audience: Pharmacists&nbsp;</span></div>\r\n\r\n<div style="font-family: sans-serif;">&nbsp;</div>\r\n\r\n<div style="font-family: sans-serif;"><span style="line-height: 20.79px;">Registration is open!&nbsp; Click on the CE tab, and select CE calendar.&nbsp; Scroll to June 22 for registration </span></div>\r\n\r\n<hr />\r\n<p>We are always adding and subtracting programs in each reagion, so please check back often - or visit our CE Calendar - for the latest continuing education offerings.</p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p><span aria-hidden="true" style="font: italic 100 300px/normal adelle-sans, serif; margin: 0px; padding: 0px; left: -999px; top: -999px; width: auto; height: auto; display: block; white-space: nowrap; position: absolute; font-size-adjust: none; font-stretch: normal;">BESbswy</span><span aria-hidden="true" style="font: italic 100 300px/normal adelle-san