86	Annual Meeting & Convention	annual-convention	\N	Conference convention annual pharmacy pharmacists		<h1><strong>NJPhA Annual Meeting and Convention</strong></h1>\r\n\r\n<p style="line-height: 20.8px;"><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/313/original_njpha_final_convention_2018_logo.png" style="width: 300px; height: 184px;" /></p>\r\n\r\n<h2 style="line-height: 20.8px;"><strong style="line-height: 20.8px;"><span style="line-height: 1.6;">Mark the date&mdash;November 9&nbsp;- 11, 2018</span></strong></h2>\r\n\r\n<p style="line-height: 20.8px;"><span style="line-height: 1.6;">Enhance your skills. Improve your practice. Advance </span><span style="line-height: 1.6;">your profession. Network and have fun.</span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="line-height: 1.6;">Get ready for a weekend of education, certification programs, networking, a student track, and social activities at the beautifully renovated Harrah&#39;s Atlantic City. This meeting is an opportunity to network with colleagues, learn about new developments in our field, obtain continuing education credits, speak with </span><span style="line-height: 1.6;">leaders in all areas of pharmacy practice and interact with the future of our profession!&nbsp;</span></p>\r\n\r\n<p style="line-height: 20.8px;">{% link_pg button, false, _self, btn-large, http://njpharmacists.org/events#id=10340&amp;cid=955&amp;wid=201<span style="line-height: 1.6;">, Save The Date&nbsp;%}&nbsp; &nbsp; &nbsp;&nbsp;</span></p>\r\n\r\n<h2 style="line-height: 20.8px;"><strong style="line-height: 1.6;">Topics as diverse as the pharmacy profession</strong></h2>\r\n\r\n<p><span style="line-height: 20.8px;">You&rsquo;re going to pack a lot into your 3 days at NJPhA&#39;s 148th Annual Meeting and Convention.</span></p>\r\n\r\n<p style="line-height: 20.8px;">You&rsquo;ll find daily sessions and a keynote speaker that bring you the latest information on how to manage several conditions, updates on treatments, and guidance on emerging legal and public-health issues. &nbsp;</p>\r\n\r\n<p style="line-height: 20.8px;"><span style="line-height: 1.6;">Students&mdash;this includes you.&nbsp; We&rsquo;ve included programming (and reduced registration fees) designed especially for tomorrow&rsquo;s pharmacist leaders. &nbsp;</span></p>\r\n\r\n<h2 style="line-height: 20.8px;"><strong style="line-height: 1.6;">Promote your products and services</strong></h2>\r\n\r\n<p style="line-height: 20.8px;"><span style="line-height: 20.8px;">With a focus on exposure and ROI, we have totally revamped our sponsorship opportunties.&nbsp; Peruse our 2018 Sponsporship and Exhibit Options <a href="http://njpharmacists.org/ckeditor_assets/attachments/318/2018_exhibit_sponsor_package_final.docx">HERE</a>.&nbsp; Get a jump on all of our exciting deals before April 1st to take advantage of our early bird discounts!&nbsp; See sponsorship packet for details.</span></p>\r\n\r\n<p style="line-height: 20.8px;">Questions?&nbsp; Contact the office at 609-275-4246 or email <a href="mailto:smiller@njpharma.org?subject=2018%20Convention%20Sponsorship%2FExhibition%20Inquiry">Samantha Miller</a></p>\r\n\r\n<h2 style="line-height: 20.8px;"><strong style="line-height: 1.6;">Present your research</strong></h2>\r\n\r\n<p style="line-height: 20.8px;">Share the results of your research with your peers at the poster session on Saturday, November 10.&nbsp; Participation in the poster session is included when you register for the Annual Meeting and Convention.&nbsp; The poster presentation submission form will be made available soon.&nbsp; In the interim, please don&#39;t hesitate to <a href="mailto:njpha@njpharma.org?subject=Research%20Poster%20Session%20Inquiry">contact us</a><span style="line-height: 1.6;"><span style="font-size:18px;">&nbsp;</span>with any questions.</span></p>\r\n\r\n<h2 style="line-height: 20.8px;"><img alt="" src="/ckeditor_assets/pictures/106/original_harrah_logo.jpg" style="float: right; width: 236px; height: 156px;" /><strong style="line-height: 20.8px;">Book your stay</strong></h2>\r\n\r\n<p>NJPhA has blocked a large number of discounted rooms for convention attendees. Please watch for accomodations information<strong style="line-height: 20.8px;"><span style="line-height: 1.6;">&mdash;</span></strong>in your email Inbox and on social media. Discounted accomodations will be available to convention attendees on a first come, first served basis.&nbsp; Once the room block is full, the prevailing hotel rate is charged.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>&nbsp;</div>\r\n	85	2016-08-23 16:35:20.13286	2018-02-01 20:05:07.378107	1	t	f	f	http://njpharmacists.org/events#id=265&wid=201&cid=955	f	f	Annual Convention	f
99	Employment Classifieds	employment_classifieds	\N			<h1>Employment Classifieds</h1>\r\n\r\n<p>Looking for a job?&nbsp; Need a professional to staff your pharmacy?&nbsp; Make connections with NJPhA&#39;s employment classifieds!&nbsp; To place an employment ad, please click <a href="http://www.njpharmacists.org/employment_classifieds/employment_advertising"><strong><span style="color:#008080;">here</span></strong></a>.&nbsp; <strong>Job seekers:&nbsp; Check out our current openings below.</strong></p>\r\n\r\n<h2>Current Openings</h2>\r\n\r\n<p><a href="#staff pharmacist">Part-time Staff Pharmacist,Wartburg, TN</a></p>\r\n\r\n<p><a href="#pharmacy operations">Pharmacy Operations Manager, Maryville, TN</a></p>\r\n\r\n<p><a href="#postgrad">Postgraduate -Year 2 Residency in Medication-Use Safety, Lake Forest, IL and Memphis TN</a></p>\r\n\r\n<hr />\r\n<p><span style="font-size:16px;"><span style="font-family: tahoma,geneva,sans-serif;"><span style="color: rgb(0, 128, 128);"><strong><a id="staff pharmacist" name="staff pharmacist"></a>Part-time Staff Pharmacist</strong></span></span></span></p>\r\n\r\n<p><span style="font-size:14px;"><span style="font-family: tahoma,geneva,sans-serif;"><strong><span style="color: rgb(0, 0, 0);">Apothecare Pharmacy</span></strong></span></span></p>\r\n\r\n<p><span style="font-size:14px;"><span style="font-family: tahoma,geneva,sans-serif;"><strong><span style="color: rgb(0, 0, 0);">Wartburg, TN</span></strong></span></span></p>\r\n\r\n<p>Apothecare Pharmacy in Wartburg, TN, is looking for a part-time staff pharmacist. For more information, please contact Jennifer Hall at 423-346-7800 or email at <a href="mailto:apothecareph@highland.net">apothecareph@highland.net</a>.</p>\r\n\r\n<hr />\r\n<p><strong><span style="font-family:tahoma,geneva,sans-serif;"><span style="font-size:16px;"><span style="color:#008080;"><a id="pharmacy operations" name="pharmacy operations"></a>Pharmacy Operations Manager</span></span></span></strong><span style="font-family:tahoma,geneva,sans-serif;"><span style="font-size:14px;"><strong><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/295/original_blount.png" style="width: 252px; height: 121px; float: right;" /></strong></span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif;"><span style="font-size:14px;"><strong>Blount Memorial</strong></span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif;"><span style="font-size:14px;"><strong>Maryville, TN</strong></span></span></p>\r\n\r\n<p>The Pharmacy Operations Manager is directly involved in the strategic planning, development, implementation and oversight of department goals and daily operations of the hospital pharmacy. Responsible for organizing and coordinating technical and operational drug distribution activities, sterile compounding, controlled substance recordkeeping, automation systems, purchasing and inventory control, human resource management of technical staff and interns, including selection, training, and supervision, staffing assignments and schedules, and ensuring compliance with federal and state regulations and standards applicable to the practice of pharmacy.</p>\r\n\r\n<p>Provides leadership for pharmacy operations on pharmacy management team. Collaborates with other hospital department leaders to ensure safe medication systems and lead pharmacy and nursing medication safety committee. Mentors and trains students, interns, and residents.</p>\r\n\r\n<p>Blount Memorial is a non-profit community hospital located in beautiful suburban Knoxville area and adjacent to Smoky Mountains and lakes/rivers, with bountiful cultural, sports, and outdoor activities.</p>\r\n\r\n<p>Pharm. D. degree or extensive pharmacist experience required. Minimum 2-3 years hospital pharmacy experience, preferably in a supervisory role. Prior pharmacy management experience, completion of PGY1 and/or PGY2 residency in management preferred.</p>\r\n\r\n<p>Apply at www.blountmemorial.org or contact Rob Lucas, Director of Pharmacy, at 865-981-2470 or <a href="mailto:rlucas@bmnet.com">rlucas@bmnet.com</a> for more information.</p>\r\n\r\n<hr />\r\n<p><span style="font-family:tahoma,geneva,sans-serif;"><span style="font-size:16px;"><strong><span style="color:#008080;"><a id="postgrad" name="postgrad"></a>Postgraduate - Year 2 Residency in Medication-use Safety</span></strong></span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif;"><strong><span style="font-size:14px;"><span style="color:#000000;">PharMEDium Services, a division of AmerisourceBergen</span></span></strong></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif;"><strong><span style="font-size:14px;"><span style="color:#000000;">Lake Forest, IL and Memphis, TN</span></span></strong></span></p>\r\n\r\n<p>PharMEDium Services, LLC, a division of AmerisourceBergen, in conjunction with The University of Tennessee College of Pharmacy, will offer a one-year pharmacy Postgraduate-Year 2 (PGY2) Residency in Medication-Use Safety. The Residency Program is designed to train highly motivated pharmacists to lead multidisciplinary teams whose functions are to: Envision a safe medication-use system for a health care organization; identify needed improvements in the present system; plan for and implement needed changes; and assess the change achieved. The PGY2 residency experience includes all facets of day-to-day operations in a human drug compounding outsourcing facility, also known as a 503B outsourcer, at the compounding facility and global activities at the corporate office.</p>\r\n\r\n<p>The goal of the program is to prepare pharmacy residents to assume responsibilities as an organizational leader in the achievement of medication-use safety in a health-system setting and/or the 503B compounding outsourcing facility environment.</p>\r\n\r\n<p>Activities are designed to expose the PGY2 resident to various components of the sterile compounding process using a sterile-to-sterile model, a culture of safety, regulatory requirements, incident event reporting, anti-diversion and risk reduction strategies, and to working in interdisciplinary teams to improve safety of medication-use processes.</p>\r\n\r\n<p>The PGY2 resident will be based primarily at the PharMEDium Memphis, Tennessee, sterile compounding center, and will conduct some rotational learning experiences with the Clinical Affairs Department staff at the Lake Forest, Illinois, (suburban Chicago) corporate office as well. In addition, the PGY2 resident will have the opportunity to participate in the education of doctor of pharmacy students through The University of Tennessee College of Pharmacy, located in Memphis.</p>\r\n\r\n<p>Minimum requirements for consideration of this position include a Doctor of Pharmacy (Pharm.D.) degree from an Accreditation Council for Pharmacy Education (ACPE)-accredited program and a PGY1 general pharmacy practice residency. Candidates must be licensed as a pharmacist or eligible for pharmacist licensure in the State of Tennessee.</p>\r\n\r\n<p>Please send your resum&eacute; to Tom Travis at <a href="mailto:ttravis@pharmedium.com">ttravis@pharmedium.com</a>.</p>\r\n	\N	2017-07-11 15:02:33.048314	2017-07-11 17:51:03.383559	0	f	f	f		f	f		f
23	Resources	resources	\N	NJ Pharmacist, pharmacy resource	Access the NJPhA Resources page for helpful local, state and federal pharmacy links, member access to the Career Center and New Jersey Journal of Pharmacy and more. 	<h1>Resources</h1>\r\n\r\n<p>Would you like to view the latest issue of {% link_pg link , false , , , 24 ,&nbsp;<em>The New Jersey Journal of&nbsp;Pharmacy</em>%} or see what&rsquo;s on the {% link_pg link , false , , , 27 , NJPhA agenda for 2015%}, or are you looking for {% link_pg link , false , , , 26 , links to state or federal pharmacy organizations%} or other pharmacy-related groups?</p>\r\n\r\n<p>The NJPhA Resource Center gives you access to a variety of materials for pharmacists in all practice settings.&nbsp;<span style="line-height: 1.6;">Look around, and if you need help finding information, don&rsquo;t hesitate to {% link_pg link , false , , , 29 , contact us%}.</span></p>\r\n	\N	2014-04-09 20:24:23.89306	2016-08-19 17:04:17.211558	6	t	t	f		f	f	NJPhA Resources	f
