19	Home Study	home-study	\N	pharmacy continuing ed, pharmacy home study	Learn about NJPhA home-study-based continuing ed programs. Earn CEU credits for pharmacy programs covering several topics for pharmacists and pharmacy technicians. 	<h1>Home Study Programs</h1>\r\n\r\n<p>To help you obtain continuing education credit as conveniently as possible, NJPhA provides an ongoing and expanding collection of coursework that can be completed from home. As indicated below, some programs are available to NJPhA members only.</p>\r\n\r\n<p>If you have any questions about the home study programs, please contact the office.</p>\r\n\r\n<h2>Important credit information</h2>\r\n\r\n<p><strong><em>Please note:</em></strong> If you completed the home study when the original issue of the journal was released, you can not obtain credit for completing it again online. Credit issued to an individual by the course UAN number once.&nbsp; Please carefully review your&nbsp;&nbsp; education record on CPE Monitor before enrolling in a home study program.</p>\r\n\r\n<hr />\r\n<h3 style="text-align: center;"><a id="click a course" name="click a course"></a>Click a course title for more information:</h3>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, arial, sans-serif; font-size: 13px; text-align: center;"><a href="#A Systematic Review of Current eHealth Technologies That Foster Medication Adherence">A Systematic Review of Current eHealth Technologies That Foster Medication Adherence</a></p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, arial, sans-serif; font-size: 13px; text-align: center;"><a href="#Zika and the Pharmacist">Zika and the Pharmacist&#39;s Role</a></p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, arial, sans-serif; font-size: 13px; text-align: center;"><a href="#Resources to Optimize Medication Adherence">Resources to Optimize Medication Adherence</a></p>\r\n\r\n<p style="text-align: center;"><a href="#Post-Lumbar HA">Post-Lumbar Puncture Headacahe: A Mini-Review for Pharmacists</a></p>\r\n\r\n<p style="text-align: center;"><a href="#Emergency Contraception"><span>Oral Emergency Contraception - Clinical and Law Overview for the Pharmacist </span></a></p>\r\n\r\n<p style="text-align: center;"><a href="#JNC8 HTN">JNC8 Evidence-Based Guidelines for Management of Hypertension in Adults: What Pharmacists Need to Know</a></p>\r\n\r\n<p style="text-align: center;"><a href="#The Cardiovascular Effects">The Role of Probiotic Supplements in the Prevention and Treatment of Atopic Dermatitis</a></p>\r\n\r\n<p style="text-align: center;"><a href="#Prescription Drug Abuse">A Brief Review of Acetaminophen and N-Acetylcysteine and its Potential Concomitant Administration</a></p>\r\n\r\n<p><a hred="#Prescription Drug Abuse"> </a></p>\r\n\r\n<p style="text-align: center;"><a href="#Current Landscape in Parenteral Nutrition">Current Landscape in Parenteral Nutrition</a></p>\r\n\r\n<p style="text-align: center;"><a href="#Hyperhidrosis">A Review of Hyperhidrosis: Assessment and Management of the Disorder</a></p>\r\n\r\n<p style="text-align: center;"><a href="#Biologic Response">Biologic Response Modifiers Used in the Treatment of Plaque Psoriasis</a></p>\r\n\r\n<p style="text-align: center;"><a href="#E-Cigarettes">The Pharmacist&#39;s Role in Wound Care with a Focus on Dressing Selection</a></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p><span style="color: rgb(128, 0, 0);"><span style="font-size: 20px;"><a id="A Systematic Review of Current eHealth Technologies That Foster Medication Adherence" name="A Systematic Review of Current eHealth Technologies That Foster Medication Adherence"></a>A Systematic Review of Current eHealth Technologies That Foster Medication Adherence&nbsp;</span></span></p>\r\n\r\n<p><span style="color:#800000;"><span style="font-size:14px;">Gino Sinigaglio, PharmD; Aakash Gandhi, PharmD;&nbsp;Rima Patel, MS; Grace Earl, PharmD*</span></span></p>\r\n\r\n<p><span style="color:#800000;"><span style="font-size:14px;">*corresponding author</span></span></p>\r\n\r\n<p style="line-height: 20.8px;">**The authors have&nbsp;no financial or other relevant relationships to disclose.</p>\r\n\r\n<p style="line-height: 20.8px;"><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p style="line-height: 20.8px;">Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists</li>\r\n\t<li style="box-sizing: border-box;">Pharmacy Technicians</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: &nbsp;1.0&nbsp;(0.1&nbsp;CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-17-034-H04-P</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-17-034-H04-T</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date:&nbsp;&nbsp;</strong>December 1<span style="box-sizing: border-box;">, 2017</span><strong style="box-sizing: border-box;">&nbsp; &nbsp; &nbsp; &nbsp;Expiration Date:&nbsp;</strong><strong style="box-sizing: border-box;">&nbsp;</strong>December 1,&nbsp;2020</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong>Activity Type:&nbsp;&nbsp;</strong>Knowledge-based</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong>&nbsp;</p>\r\n\r\n<div style="line-height: 22px; box-sizing: border-box;">\r\n<div style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">The purpose of this assessment is to inform healthcare professionals and allied health professionals of emerging eHealth technologies that can be integrated into their practice to overcome adherence barriers.</div>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;"><strong>Objectives</strong></p>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;"><em>At the completion of this activity, pharmacists will be able to:</em></p>\r\n\r\n<ul style="">\r\n\t<li style="line-height: 20.8px;"><i style=""><font face="adelle-sans, helvetica, sans-serif"><span style="font-size: 14px;">Justify the use of specific eHealth technologies in improving medication adherence based on the evidence</span></font></i></li>\r\n\t<li style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;"><em>Identify the specific kind of adherence support provided by eHealth technology in improving medication adherence</em></li>\r\n\t<li style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;"><em>Distinguish the types of eHealth tools based on how the technology is used by the patient or pharmacist in improving medication adherence</em></li>\r\n</ul>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;"><em>At the completion of this activity, pharmacist technicians will be able to:</em></p>\r\n\r\n<ul style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px;">\r\n\t<li style="line-height: 20.8px;"><em>​Describe the extent of medication non-adherence affecting management of chronic diseases</em></li>\r\n\t<li style="line-height: 20.8px;"><em>Identify the specific type of adherence support provided by eHealth technology in improving medication adherence</em></li>\r\n\t<li style="line-height: 20.8px;"><i>Compare the specific types of eHealth technology tools based on the type of technology and type of adherence support</i></li>\r\n</ul>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;">{% endsliding_div %}</p>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;">{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=10329&amp;cid=955&amp;wid=201, Register %}</p>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; text-align: center; line-height: 20.8px;"><a href="#click a course"><em>Back to top</em></a></p>\r\n</div>\r\n\r\n<p><span style="color:#800000;"><span style="font-size:20px;"><a id="Resources to Optimize Medication Adherence" name="Resources to Optimize Medication Adherence"></a>Resources to Optimize Medication&nbsp;Adherence</span></span></p>\r\n\r\n<p><span style="color:#800000;"><span style="font-size:14px;">Sibyl M. Cherian, PharmD; Christine Lam, PharmD, BCPS</span></span></p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 20.8px;">**The author&nbsp;has&nbsp;no financial or other relevant relationships to disclose.</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 20.8px;"><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255); line-height: 20.8px;">Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p style="color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="padding: 0px 40px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists</li>\r\n\t<li style="box-sizing: border-box;">Pharmacy Technicians</li>\r\n</ul>\r\n\r\n<p style="color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="padding: 0px 40px; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: &nbsp;1.0&nbsp;(0.1&nbsp;CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-17-019-H04-P</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-17-019-H04-T</li>\r\n</ul>\r\n\r\n<p style="color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date:&nbsp;&nbsp;</strong><span style="box-sizing: border-box;">September 8, 2017</span><strong style="box-sizing: border-box;">&nbsp; &nbsp; &nbsp; &nbsp;Expiration Date:&nbsp;</strong><strong style="box-sizing: border-box;">&nbsp;</strong>September 8,&nbsp;2020</p>\r\n\r\n<p style="color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong>Activity Type:&nbsp;&nbsp;</strong>Knowledge-based</p>\r\n\r\n<p style="color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong>&nbsp;</p>\r\n\r\n<div style="color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">\r\n<div style="font-size: 14px; font-family: adelle-sans, helvetica, sans-serif; color: rgb(51, 51, 51); box-sizing: border-box;">The purpose of this lesson is to provide a brief overview of resources to help optimize medication adherence</div>\r\n\r\n<p style="line-height: 20.8px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="line-height: 20.8px;"><strong>Objectives</strong></p>\r\n\r\n<p style="line-height: 20.8px;"><em>At the completion of this activity, pharmacists will be able to:</em></p>\r\n\r\n<ul>\r\n\t<li style="line-height: 20.8px;"><em>Identify barriers to medication adherence</em></li>\r\n\t<li style="line-height: 20.8px;"><em>Describe management systems and accountability system for coupons, vouchers, and patient assistant program</em></li>\r\n\t<li style="line-height: 20.8px;"><em>Describe different strategies for improving patient education</em></li>\r\n</ul>\r\n\r\n<p style="line-height: 20.8px;"><em>At the completion of this activity, pharmacist technicians will be able to:</em></p>\r\n\r\n<ul>\r\n\t<li style="line-height: 20.8px;"><em>​List common medication adherence barriers</em></li>\r\n\t<li style="line-height: 20.8px;"><em>Describe coupon options, vouchers, and patient assistance programs</em></li>\r\n\t<li style="line-height: 20.8px;"><em>Explain patient education strategies</em></li>\r\n</ul>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255); line-height: 20.8px;">{% endsliding_div %}</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255); line-height: 20.8px;">{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=10322&amp;cid=955&amp;wid=201, Register %}</p>\r\n\r\n<p style="text-align: center; line-height: 20.8px;"><a href="#click a course" style="color: rgb(7, 130, 193);"><em>Back to top</em></a></p>\r\n</div>\r\n\r\n<p><a id="Zika and the Pharmacist" name="Zika and the Pharmacist"></a><span style="color:#800000;"><span style="line-height: 1.1;"><span style="font-size: 20px;">Zika and the Pharmacist</span></span></span></p>\r\n\r\n<p><span style="font-size: 14px;"><span style="color: rgb(128, 0, 0);">Asha Gupta, PharmD, RPh</span></span></p>\r\n\r\n<div>\r\n<p style="line-height: 20.8px;">**The author&nbsp;has&nbsp;no financial or other relevant relationships to disclose.</p>\r\n\r\n<p style="line-height: 20.8px;"><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p style="line-height: 20.8px;">Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists</li>\r\n\t<li style="box-sizing: border-box;">Pharmacy technicians&nbsp;</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: &nbsp;1.0&nbsp;(0.1&nbsp;CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-16-035-H04-P</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-16-035-H04-T</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date:&nbsp;&nbsp;</strong><span style="box-sizing: border-box;">December 02, 2016</span><strong style="box-sizing: border-box;">&nbsp;&nbsp; &nbsp; &nbsp; Expiration Date:&nbsp;</strong><strong style="box-sizing: border-box;">&nbsp;</strong>December 02,&nbsp;2019</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong>Activity Type:&nbsp;&nbsp;</strong>Knowledge-based</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">This paper aims to highlight key points that healthcare professionals should know about the Zika virus, as it persists to threaten our communities and healthcare settings.\r\n<p style="line-height: 20.8px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="line-height: 20.8px;"><em>At the completion of this activity, pharmacists will be able to:</em></p>\r\n\r\n<ul style="line-height: 20.8px;">\r\n\t<li>Describe Zika viral transmission and prevalence</li>\r\n\t<li>Investigate the prevalence of the Zika virus globally, using information from reliable resources</li>\r\n\t<li>Explain to patients any available prevention methods</li>\r\n\t<li>Identify high-risk areas, populations at-risk, and patients who should be tested if there is possible Zika virus exposure</li>\r\n\t<li>Compile additional resources for personal knowledge and patient education</li>\r\n</ul>\r\n\r\n<p style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 20.8px;"><em>At the completion of this activity, technicians will be able to:</em></p>\r\n\r\n<ul style="line-height: 20.8px;">\r\n\t<li>Describe Zika viral transmission and prevalence</li>\r\n\t<li>Investigate the prevalence of the Zika virus globally, using information from reliable resources</li>\r\n\t<li>Identify additional resources for more information on Zika virus</li>\r\n</ul>\r\n\r\n<p style="line-height: 20.8px;">{% endsliding_div %}</p>\r\n\r\n<p style="line-height: 20.8px;">{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=10289&amp;cid=955&amp;wid=201, Register %}</p>\r\n\r\n<p style="text-align: center; line-height: 20.8px;"><a href="#click a course"><em>Back to top</em></a></p>\r\n</div>\r\n</div>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans,helvetica,sans-serif; font-size: 18px; margin-top: 20px; margin-bottom: 10px; box-sizing: border-box;"><span style="line-height: 1.1;"><a id="Post-Lumbar HA" name="Post-Lumbar HA"></a><span style="font-size:20px;">Post-Lumbar Puncture Headache: A Mini-Review for Pharmacists</span></span></h4>\r\n\r\n<p><span style="font-size: 14px;"><span style="color: rgb(128, 0, 0);">Maria Leibfried, BS, PharmD, BCNSP, CCP,&nbsp;Daniel Sievers, BS,&nbsp;PharmD Candidate, 2016</span></span></p>\r\n\r\n<p style="line-height: 20.8px;">**The authors have no financial or other relevant relationships to disclose.</p>\r\n\r\n<p style="line-height: 20.8px;"><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p style="line-height: 20.8px;">Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists</li>\r\n\t<li style="box-sizing: border-box;">Pharmacy technicians&nbsp;</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: &nbsp;0.5 (0.05 CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-16-015-H04-P</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-16-015-H04-T</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date:&nbsp;&nbsp;</strong><span style="box-sizing: border-box;">June 03, 2016</span><strong style="box-sizing: border-box;">&nbsp;&nbsp; &nbsp; &nbsp; Expiration Date: </strong><strong style="box-sizing: border-box;">&nbsp;</strong>June 03, 2019</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong>Activity Type:&nbsp;&nbsp;</strong>Knowledge-based</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">The goal of this lesson is to provide basic background on post-lumbar puncture headaches including epidemiology, <span style="font-size: 14px;">clinical presentation, pathophysiology, and recommended treatment options.&nbsp;</span></div>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">\r\n<p style="line-height: 20.8px;"><span style="font-size: 14px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size: 14px;">At the completion of this activity, pharmacists will be able to</span></p>\r\n\r\n<ul style="line-height: 20.8px;">\r\n\t<li><span style="font-size: 14px;">Define lumbar puncture (LP)</span></li>\r\n\t<li><span style="font-size: 14px;">List common adverse effects from LP</span></li>\r\n\t<li><span style="font-size: 14px;">Discuss post-LP headache</span></li>\r\n\t<li><span style="font-size: 14px;">Describe treatment options for post-LP headache</span></li>\r\n</ul>\r\n\r\n<p><span style="font-size: 14px;">At the completion of this activity, pharmacy technicians will be able to&nbsp;</span></p>\r\n\r\n<ul style="line-height: 20.8px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px;">\r\n\t<li><span style="font-size: 14px;">Define lumbar puncture (LP)</span></li>\r\n\t<li><span style="font-size: 14px;">List common adverse effects from LP</span></li>\r\n\t<li><span style="font-size: 14px;">Define post-LP headache</span></li>\r\n\t<li><span style="font-size: 14px;">List treatment options for post-LP headache</span></li>\r\n</ul>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size: 14px;">{% endsliding_div %}</span></p>\r\n\r\n<p style="line-height: 20.8px;">{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=10269&amp;cid=955&amp;wid=201, Register %}</p>\r\n\r\n<p style="text-align: center; line-height: 20.8px;"><a href="#click a course"><em>Back to top</em></a></p>\r\n</div>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans,helvetica,sans-serif; font-size: 18px; margin-top: 20px; margin-bottom: 10px; box-sizing: border-box;"><span><a id="Emergency Contraception" name="Emergency Contraception"></a><span style="font-size:20px;">Oral Emergency Contraception - Clinical and Law Overview for the Pharmacist</span></span></h4>\r\n\r\n<p><span style="font-size: 14px;"><span style="color: rgb(128, 0, 0);"><span style="line-height: 1.6; box-sizing: border-box;">Maria Leibfried, BS, PharmD, BCNSP, CCP, Alexandra Libman, PharmD</span></span></span></p>\r\n\r\n<p>**The authors have no financial or other relevant relationships to disclose.</p>\r\n\r\n<p><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: 1.0 (0.1 CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-16-007-H04-P</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date:&nbsp; </strong><span style="box-sizing: border-box;">March, 10, 2016</span><strong style="box-sizing: border-box;"> &nbsp; &nbsp; &nbsp; Expiration Date:&nbsp; </strong>March 10, 2019</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong>Activity Type:&nbsp; </strong>Knowledge-based</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">The goal of this lesson is to provide information on currently available oral emergency contraceptives (EC). It will also compare the different ora<span style="font-size: 14px;">l EC options and discuss New Jersey&#39;s laws and regulations that affect the utilization of EC.</span></div>\r\n\r\n<p style="line-height: 20.79px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="line-height: 20.79px;">At the completion of this activity, pharmacists will be able to</p>\r\n\r\n<ul style="line-height: 20.79px;">\r\n\t<li>Define emergency contraception</li>\r\n\t<li>Describe the different types of emergency contraceptives that are available</li>\r\n\t<li>Explain the regulations surrounding the dispensing of emergency contraception</li>\r\n</ul>\r\n\r\n<p style="line-height: 20.79px;">{% endsliding_div %}</p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large, <a href="http://njpharmacists.org/events#id=10268&amp;cid=955&amp;wid=201">http://njpharmacists.org/events#id=10268&amp;cid=955&amp;wid=201</a>, Register %}</p>\r\n\r\n<p style="text-align: center;"><a href="#click a course" style="text-align: center;"><em>Back to top</em></a></p>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 18px; margin-top: 20px; margin-bottom: 10px; box-sizing: border-box;"><span style="line-height: 1.6; box-sizing: border-box;"><a id="JNC8 HTN" name="JNC8 HTN"></a><span style="font-size:20px;">JNC8 Evidence-Based Guidelines for Management of Hypertension in Adults: What Pharmacists Need to Know</span></span><span style="font-size:20px;"><span style="line-height: 1.6;">&nbsp;</span></span></h4>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;"><span style="line-height: 1.6; box-sizing: border-box;">Julie Kalabalik, PharmD, BCPS, Nina Elk, PharmD, Jesse Sullivan, PharmD, BCPS</span></h4>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">\r\n<p><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n</div>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists and pharmacy technicians</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: 1 (0.1 CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-15-019-H01P</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-15-019-H01T</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date: </strong><span style="box-sizing: border-box;">&nbsp;July 06, 2015</span><strong style="box-sizing: border-box;">&nbsp; &nbsp; &nbsp; &nbsp; Expiration Date: &nbsp;</strong>July 06, 2018</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">The goal of this lesson is to provide information on the updates and differences between previous JNC7 guidelines and JNC8 guidelines to provide hypertensive care using current evidence based recommendations.</div>\r\n\r\n<p style="line-height: 20.79px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="line-height: 20.79px;">At the completion of this activity, pharmacists will be able to</p>\r\n\r\n<ul style="line-height: 20.79px;">\r\n\t<li>Describe JNC8 guidelines</li>\r\n\t<li>List treatment goals for JNC8</li>\r\n</ul>\r\n\r\n<p style="line-height: 20.79px;">&nbsp;</p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size: 14px;">{% endsliding_div %}</span></p>\r\n\r\n<p style="line-height: 20.8px;">{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=219&amp;cid=955&amp;wid=201, Register %}</p>\r\n\r\n<div style="text-align: center;"><a href="#click a course" style="text-align: center;"><em>Back to top</em></a></div>\r\n\r\n<hr />\r\n<p><a id="The Cardiovascular Effects" name="The Cardiovascular Effects"></a><span style="color:#800000;"><span style="font-size:18px;">The Role of Probiotic Supplements in the Prevention and Treatment of Atopic Dermatitis</span></span></p>\r\n\r\n<h3><span style="color: rgb(128, 0, 0);">Celia Lu, PharmD, BCACP</span></h3>\r\n\r\n<p><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p><strong>Audience</strong></p>\r\n\r\n<ul>\r\n\t<li>Pharmacists and pharmacy technicians</li>\r\n</ul>\r\n\r\n<p><strong style="line-height: 1.6;">Credit</strong></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:12px;">Contact hours: 1.0 (0.1 CEU)</span></li>\r\n\t<li><span style="font-size:12px;"><span style="font-family:arial,helvetica,sans-serif;">UAN number: 0136-0000-16-018-H01-P</span></span></li>\r\n\t<li><span style="font-size:12px;">UAN number: 0136-0000-16-018-H01-T</span></li>\r\n</ul>\r\n\r\n<p><strong>Release Date:</strong> &nbsp;<span style="font-size:12px;">September, 14, 2016 &nbsp; </span>&nbsp; &nbsp; &nbsp;<strong>Expiration Date: &nbsp;</strong><span style="font-size:12px;"><span style="font-family:arial,helvetica,sans-serif;">September, 14, 2019</span></span></p>\r\n\r\n<p><strong>Activity Type:&nbsp; </strong>Knowledge-based</p>\r\n\r\n<p><strong>Goal</strong></p>\r\n\r\n<p><span style="color: rgb(0, 0, 0); font-family: arial, sans-serif;">This program will review current data that is available regarding the use of probiotics in the prevention and treatment of Atopic Dermatitis.&nbsp;</span></p>\r\n\r\n<p>{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p>After participating in this activity, the pharmacist shall be able to:</p>\r\n\r\n<div class="page" title="Page 1">\r\n<div class="layoutArea">\r\n<div class="column">\r\n<ul>\r\n\t<li><span style="font-family: Helvetica;">Discuss the possible role of genetics in atopic dermatitis</span></li>\r\n\t<li>Recognize the role of probiocits in the primary prevention of atopic dermatitis</li>\r\n\t<li>State the pathophysiology of atopic dermatitis</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>After participating in this activity, the pharmacy technician shall be able to:</p>\r\n\r\n<div class="page" title="Page 1">\r\n<div class="layoutArea">\r\n<div class="column">\r\n<ul>\r\n\t<li>Discuss the definition of a probiotic</li>\r\n\t<li><span style="font-family: Helvetica;">Discuss the possible roles of probiotics in the management of inflammatory disease</span></li>\r\n\t<li>State the role of atopic dermatitis in the allergy&nbsp;</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>{% endsliding_div %}</p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large, http://njpharmacists.org/events#id=118&amp;cid=955&amp;wid=201,&nbsp;Register %}</p>\r\n\r\n<p style="text-align: center;"><a href="#click a course" style="text-align: center;"><em>Back to top</em></a></p>\r\n\r\n<hr />\r\n<h4><span style="color:#B22222;"><a id="Prescription Drug Abuse" name="Prescription Drug Abuse"></a></span><span style="color:#800000;"><span style="font-size: 18px;">A Brief Review of Acetaminophen and N-Acetylcysteine and its Potential Concomitant Administration</span></span></h4>\r\n\r\n<p><span style="color:#800000;"><span style="font-size: 14px;">Timothy Nguyen, PharmD, BCPS, CCP, FASCP</span></span></p>\r\n\r\n<p>**The author has no financial or other relevant relationships to disclose.</p>\r\n\r\n<p>(Members, free. Nonmembers, $15.)</p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p><strong>Audience</strong></p>\r\n\r\n<ul>\r\n\t<li>Pharmacists</li>\r\n\t<li>Pharmacy Technicians</li>\r\n</ul>\r\n\r\n<p><strong>Credit </strong></p>\r\n\r\n<ul>\r\n\t<li>Contact hours &ndash; 1.0 (0.1 CEU)</li>\r\n\t<li>UAN: 0136-0000-17-001-H04-P; 0136-0000-17-001-H04-T</li>\r\n</ul>\r\n\r\n<p><strong>Release Date:&nbsp; </strong>February 1, 2017 &nbsp; <strong>Expiration Date</strong>: February 1, 2020</p>\r\n\r\n<p><strong>Activity Type:&nbsp; </strong>Knowledge-based</p>\r\n\r\n<p><strong>Goal</strong></p>\r\n\r\n<p>The purpose of this study was to provide a brief overview of acetaminophen (APAP), N-acetylcysteine (NAC)&nbsp;and the effects of concomitant administration of APAP and NAC.</p>\r\n\r\n<p>{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p>After participating in this activity, pharmacists will be able to:</p>\r\n\r\n<ul>\r\n\t<li>Describe the history and the roles of acetaminophen (APAP)</li>\r\n\t<li>Explain the role of N-acetylcysteine (NAC) for APAP overdose and its concomitant administration with APAP</li>\r\n\t<li>Explain the impact of co-administering APAP and NAC in terms of protecting the liver from toxicity</li>\r\n</ul>\r\n\r\n<p>After participating in this activity, pharmacy technician will be able to:</p>\r\n\r\n<ul>\r\n\t<li>Recall the history and the roles of acetaminophen (APAP)</li>\r\n\t<li>Recognize the role of N-acetylcysteine (NAC) for APAP overdose and its concomitant administration with APAP</li>\r\n\t<li>Identify the impact of co-administering APAP and NAC in terms of protecting the liver from toxicity</li>\r\n</ul>\r\n\r\n<p>{% endsliding_div %}</p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large, http://njpharmacists.org/events#id=10298&amp;cid=955&amp;wid=201, Register&nbsp;%}</p>\r\n\r\n<p style="text-align: center;"><a href="#click a course" style="text-align: center;"><em>Back to top</em></a></p>\r\n\r\n<h4><a id="Current Landscape in Parenteral Nutrition" name="Current Landscape in Parenteral Nutrition"></a><span style="color:#800000;"><span style="font-size:20px;">Current Landscape in Parenteral Nutrition</span></span></h4>\r\n\r\n<h3><span style="color: rgb(128, 0, 0);">Malgorzata Slugocki, PharmD</span></h3>\r\n\r\n<h4>Assistant Professor of Pharmacy Practice, Fairleigh Dickinson University School of Pharmacy, Florham Park, NJ</h4>\r\n\r\n<p>Rachel L. Rivera, PharmD, MHA, BCACP, Clinical Assistant Professor, Fairleigh Dickinson University School of Pharmacy, Florham Park, NJ</p>\r\n\r\n<p><em>Authors acknowledge Julie Kalabalik, PharmD,BCPS for contributing to the article</em></p>\r\n\r\n<p>**The author has no financial or other relevant relationships to disclose.</p>\r\n\r\n<p><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n\r\n<p><strong>Audience</strong></p>\r\n\r\n<ul>\r\n\t<li>Pharmacists and pharmacy technicians</li>\r\n</ul>\r\n\r\n<p><strong>Credit </strong></p>\r\n\r\n<p>Contact hours &ndash; 1.0 (0.1 CEU)</p>\r\n\r\n<p>UAN: 0136-0000-15-032-H04-P; 0136-0000-15-032-H04-T</p>\r\n\r\n<p><strong>Release Date:</strong>12/14/15<strong> </strong>&nbsp; <strong>Expiration Date</strong>: 12/14/18</p>\r\n\r\n<p><strong>Activity Type:&nbsp; </strong>Knowledge-based</p>\r\n\r\n<p><strong>Goal</strong></p>\r\n\r\n<p>The goal of this activity is to provide a review of the current treatment of identifying patients who benefit from parenteral nutrition and assessing the administration, sources, and treatments options available to patients.</p>\r\n\r\n<p>{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p>After participating in this activity, pharmacists and the pharmacy technicians will be able to:</p>\r\n\r\n<p><strong>Pharmacist:</strong></p>\r\n\r\n<ul>\r\n\t<li>Define parenteral nutrition.</li>\r\n\t<li>Identify patients who can benefit from parenteral nutrition.</li>\r\n\t<li>Name common sources and commercially available solutions of macronutrients.</li>\r\n\t<li>Describe the caloric contribution from each macronutrient.</li>\r\n\t<li>Describe benefits and possible risks of lipid administration.</li>\r\n\t<li>Differentiate between the routes of administration of total parenteral nutrition and name the concentrations limits that need to be observed.</li>\r\n\t<li>Describe the macro- and micronutrient requirements for adult and pediatric patients.</li>\r\n\t<li>Describe the present challenges in of parenteral nutrition prescribing and preparations.</li>\r\n</ul>\r\n\r\n<p><strong>Pharmacy Technician: </strong></p>\r\n\r\n<ul>\r\n\t<li>Define parenteral nutrition.</li>\r\n\t<li>Identify patients who can benefit from parenteral nutrition.</li>\r\n\t<li>Name common sources and commercially available solutions of macronutrients</li>\r\n</ul>\r\n\r\n<p>{% endsliding_div %}</p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=234&amp;wid=201&amp;display=search&amp;term=parenteral&amp;cid=955, Register %}</p>\r\n\r\n<p style="text-align: center;"><a href="#click a course" style="text-align: center;"><em>Back to top</em></a></p>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 18px; margin-top: 20px; margin-bottom: 10px; box-sizing: border-box;"><a id="Hyperhidrosis" name="Hyperhidrosis"></a><span style="font-size:20px;">A Review of Hyperhidrosis: Assessment and Management of the Disorder</span></h4>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;"><span style="line-height: 1.6; box-sizing: border-box;">William Maidhof, PharmD</span></h4>\r\n\r\n<p><span style="line-height: 1.6; box-sizing: border-box;">Assistant Professor/Industry Professional, St. Johns University, College of Pharmacy and Health Sciences </span></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">**The author has no financial or other relevant relationships to disclose.</div>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">&nbsp;</div>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">\r\n<p><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n</div>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists and pharmacy technicians</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: 1 (0.1 CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-15-011-H01-P</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-15-011-H01-T</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date: </strong><span style="box-sizing: border-box;">&nbsp;</span>04/01/2015<strong style="box-sizing: border-box;">&nbsp; &nbsp; &nbsp; &nbsp; Expiration Date: &nbsp;</strong>04/01/2018</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">The goal of this activity is to provide a review of Hyperhidrosis Disorder describing treatment options and identifying differences in the primary and secondary types of the disorder.</div>\r\n\r\n<p style="line-height: 20.79px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="line-height: 20.79px;">At the completion of this activity, pharmacists will be able to</p>\r\n\r\n<ul style="line-height: 20.79px;">\r\n\t<li>Define hyperhidrosis</li>\r\n\t<li>Differentiate between primary and secondary hyperhidrosis</li>\r\n\t<li>Describe treatment options for hyperhidrosis</li>\r\n</ul>\r\n\r\n<p>At the completion of this activity, pharmacy technicians will be able to</p>\r\n\r\n<ul>\r\n\t<li>Define hyperhidrosis, primary hyperhidrosis, and secondary hyperhidrosis</li>\r\n\t<li>Identify treatment options for hyperhidrosis</li>\r\n</ul>\r\n\r\n<p style="line-height: 20.79px;">{% endsliding_div %}</p>\r\n\r\n<p style="line-height: 20.79px;">{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=232&amp;wid=201&amp;display=search&amp;term=hyperhidrosis&amp;cid=955, Register %}</p>\r\n\r\n<p style="text-align: center;"><a href="#click a course" style="text-align: center;"><em>Back to top</em></a></p>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 18px; margin-top: 20px; margin-bottom: 10px; box-sizing: border-box;"><a id="Biologic Response" name="Biologic Response"></a><span style="font-size:20px;">Biologic Response Modifiers Used in the Treatment of Plaque Psoriasis</span></h4>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;"><span style="line-height: 1.6; box-sizing: border-box;">Julie Kalabalik, PharmD, BCPS</span></h4>\r\n\r\n<p><span style="line-height: 1.6; box-sizing: border-box;">Assistant Professor of Pharmacy Practice, Fairleigh Dickison University, School of Pharmacy, Florham Park, NJ</span></p>\r\n\r\n<p><span style="line-height: 1.6; box-sizing: border-box;">Janna Denisenko, BS, PharmD Candidate, Fairleigh Dickison University, School of Pharmacy, Florham Park, NJ</span></p>\r\n\r\n<p><span style="line-height: 1.6; box-sizing: border-box;">Ligia Westrich, PhD, RPh, Assistant Professor of Pharmaceutical Sciences, Fairleigh Dickison University, School of Pharmacy, Florham Park, NJ</span></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">**The authors have no financial or other relevant relationships to disclose.</div>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">&nbsp;</div>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">\r\n<p><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n</div>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists and pharmacy technicians</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: 1 (0.1 CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-15-H01-P&nbsp;</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-15-H01-T</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date: </strong><span style="box-sizing: border-box;">&nbsp;</span>09/15/2015<strong style="box-sizing: border-box;">&nbsp; &nbsp; &nbsp; Expiration Date: &nbsp;</strong>09/15/2018</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">The goal of this activity is to provide a review of the Biologic Response Modifiers used in the treatment of plaque psoriasis.</div>\r\n\r\n<p style="line-height: 20.79px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="line-height: 20.79px;">At the completion of this activity, pharmacists will be able to</p>\r\n\r\n<ul style="line-height: 20.79px;">\r\n\t<li>Describe the incidence of psoriasis</li>\r\n\t<li>Identify the symptoms of psoriasis</li>\r\n\t<li>Discuss new treatment options for psoriasis</li>\r\n</ul>\r\n\r\n<p>At the completion of this activity, pharmacy technicians will be able to</p>\r\n\r\n<ul>\r\n\t<li>Describe the incidence of psoriasis</li>\r\n\t<li>Identify the symptoms of psoriasis</li>\r\n\t<li>List new treatment options for psoriasis</li>\r\n</ul>\r\n\r\n<p style="line-height: 20.79px;">{% endsliding_div %}</p>\r\n\r\n<p style="line-height: 20.79px;">{% link_pg button, false, _self, btn-large,http://njpharmacists.org/events#id=233&amp;wid=201&amp;display=search&amp;term=psoriasis&amp;cid=955, Register %}</p>\r\n\r\n<p style="text-align: center;"><em style="text-align: center;"><a href="#click a course" style="text-align: center;">Back to top</a></em></p>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 18px; margin-top: 20px; margin-bottom: 10px; box-sizing: border-box;"><a id="E-Cigarettes" name="E-Cigarettes"></a><span style="font-size:20px;">The Pharmacist&#39;s Role In Wound Care witha Focus on Dressing Selection</span></h4>\r\n\r\n<h4 style="color: rgb(133, 21, 40); line-height: 1.1; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 10px; margin-bottom: 10px; box-sizing: border-box;"><span style="line-height: 1.6; box-sizing: border-box;">Sean LaFlamme, PharmD, CWCA, CGP, BCPS</span></h4>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">**The author has no financial or business relationships to disclose in reference to this artricle</div>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">&nbsp;</div>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">\r\n<p><em>(Members, free. Nonmembers, $15.)</em></p>\r\n\r\n<p>Members must {% link_pg link , false , , , 33 , log in%} to obtain the members fee. Not a member? {% link_pg link , false , , , 7 , Join the Association%}.</p>\r\n</div>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Audience</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Pharmacists&nbsp;</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Credit</strong></p>\r\n\r\n<ul style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 10px; box-sizing: border-box;">\r\n\t<li style="box-sizing: border-box;">Contact hours: 0.5 &nbsp;(0.05CEU)</li>\r\n\t<li style="box-sizing: border-box;">UAN: 0136-0000-17-017-H04-P</li>\r\n</ul>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Release Date: </strong>05/24/17<strong style="box-sizing: border-box;"> &nbsp; &nbsp; Expiration Date: &nbsp;</strong>05/24/20</p>\r\n\r\n<p style="margin: 0px 0px 10px; line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;"><strong style="box-sizing: border-box;">Goal&nbsp;</strong></p>\r\n\r\n<div style="line-height: 22px; font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; box-sizing: border-box;">The goal of this activity is to highlight the factors to consider when selecting wound care dressing products</div>\r\n\r\n<p style="line-height: 20.79px;">{% sliding_div Click to view the program&#39;s objectives.&nbsp;%}</p>\r\n\r\n<p style="line-height: 20.79px;">At the completion of the activity, the pharmacists will be able to</p>\r\n\r\n<ul style="line-height: 20.79px;">\r\n\t<li>\r\n\t<p>Determine the place in therapy for common wound care dressing products</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Identify medical conditions that effect wound healing</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Review different dressing classes</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p style="line-height: 20.79px;">{% endsliding_div %}</p>\r\n\r\n<p style="line-height: 20.79px;">{% link_pg button, false, _self, btn-large, http://njpharmacists.org/events#id=10313&amp;cid=955&amp;wid=201 , Register %}</p>\r\n\r\n<p style="text-align: center;"><a href="#click a course" style="text-align: center;"><em>Back to top</em></a></p>\r\n\r\n<p><em style="color: rgb(51, 51, 51); line-height: 20.79px; font-family: adelle-sans, arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/8/content_acpe.jpg" style="width: 50px; height: 50px; margin-top: 5px; margin-bottom: 5px; float: left; cursor: default;" /><span style="font-size: 12px;">The New Jersey Pharmacists Association is accredited by the Accreditation Council for Pharmacy Education as a provider of continuing pharmacy education. Proof of participation&nbsp;will be submitted to mycpemonitor.net within 60 days subject to documented attendance and completion of online evaluation materials.</span></em></p>\r\n	16	2014-04-09 19:43:03.300561	2017-12-01 16:44:33.98099	4	t	t	f		f	f	Pharmacy Home Study Programs	f
