90	Legislative Day	legislative-day	\N			<h1>Legislative Day</h1>\r\n\r\n<p><span class="st">Legislative Day is a great opportunity to do more than just voice an opinion, it is a </span>chance to get up close and involved with the legislation - and legislators - who create and debate the bills that affect the pharmacy profession in New Jersey.&nbsp; Our December 2017 Legislative Day was held at the Trenton State House.&nbsp; On December 7, students were clad in white pharmacy coats and, along with NJPhA&#39;s Legislative Counsel,&nbsp;attended an Assembly voting session and toured the State House. Please watch our <a href="http://www.njpharmacists.org/continuing-education/CE-Calendar#cid=955&amp;wid=201">events calendar </a>for the next opportunity to get involved!</p>\r\n	85	2016-08-27 16:05:37.820722	2018-01-02 18:16:57.326934	5	t	f	f	http://njpharmacists.org/events#id=10287&cid=955&wid=201&type=Cal	f	f		f
6	Benefits	benefits	\N	NJPHA, New Jersey Pharmacist, NJ pharmacist	Join NJPhA to access many benefits, such as discounts on live and remote pharmacy continuing education, online access to the NJ Journal of Pharmacy, and more.	<h1>NJPhA Benefits</h1>\r\n\r\n<p>As a member, you&rsquo;ll automatically be notified by email about {% link_pg link , false , , , 31 , legislative updates%}, continuing education programs (with member-only discounts), specialty training and best-practice discussions, full online access to {% link_pg link , false , , , 24 , <em>The New Jersey Journal of Pharmacy</em>%}, access to&nbsp;comprehensive personal and professional insurance, discounts on student loans,&nbsp;<span style="line-height: 1.6;">an active {% link_pg link , false , , , 25 , career center%} and more.</span></p>\r\n\r\n<p>But the benefits don&rsquo;t stop with you. When you join NJPhA, you&rsquo;re helping others in your profession and the people that they serve.</p>\r\n\r\n<p>Here&rsquo;s how.</p>\r\n\r\n<h2>Help your patients</h2>\r\n\r\n<ul>\r\n\t<li>Support initiatives to increase immunization rates in New Jersey</li>\r\n\t<li>Establish collaborative practice models to better manage disease states and increase wellness visits</li>\r\n</ul>\r\n\r\n<h2>Help your profession</h2>\r\n\r\n<ul>\r\n\t<li>Advocate CMS Provider status for pharmacists</li>\r\n\t<li>Write articles or provide peer reviews for {% link_pg link , false , , , 24 , ​<em>The New Jersey Journal of Pharmacy</em>%}</li>\r\n</ul>\r\n\r\n<h2>Increase your knowledge</h2>\r\n\r\n<ul>\r\n\t<li>Training opportunities that connect theory and practice.\r\n\t<ul>\r\n\t\t<li>Association-sponsored {% link_pg link , false , , , 17 , regional continuing education%} programs</li>\r\n\t\t<li>Live and pre-recorded {% link_pg link , false , , , 18 , webinars%}</li>\r\n\t\t<li>{% link_pg link , false , , , 20 , Specialty Certificate%} Programs with member discounts</li>\r\n\t\t<li>Free continuing education via {% link_pg link , false , , , 24, ​<em>The New Jersey Journal of Pharmacy</em>%}&nbsp;</li>\r\n\t\t<li>Specialized-topic {% link_pg link , false , , , 21 , Academy forums%}\r\n\t\t<ul>\r\n\t\t\t<li>Consulting, Compounding, Disaster Management</li>\r\n\t\t</ul>\r\n\t\t</li>\r\n\t</ul>\r\n\t</li>\r\n</ul>\r\n\r\n<h2>Expand your network</h2>\r\n\r\n<ul>\r\n\t<li>{% link_pg link , false , , , 17 , Annual Meeting and Convention%}</li>\r\n\t<li>{% link_pg link , false , , , 17 , March Madness training and networking%}</li>\r\n\t<li>{% link_pg link , false , , , 17 , Regional gatherings%}</li>\r\n\t<li>{% link_pg link , false , , , 4 , Proactive committees%}</li>\r\n\t<li>Expansive <a href="https://www.facebook.com/NJPhA">Facebook</a> and <a href="https://www.linkedin.com/groups?gid=2804149">LinkedIn</a> communities</li>\r\n</ul>\r\n\r\n<p>{% link_pg button, false, _self, btn-large, 7, Join Now%}</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n	5	2014-04-09 16:11:58.852952	2017-01-05 18:04:15.904321	4	t	t	f		f	f	NJPhA Membership Benefits 	f
