5	Membership	membership	\N	NJPHA, New Jersey Pharmacist, NJ pharmacist	Membership in NJPhA has many benefits: live, online, and remote pharmacy continuing education, access to the New Jersey Journal of Pharmacy, pharmacy awards and more. 	<h1>NJPhA Membership</h1>\r\n\r\n<p>Nobody has to tell you that the pace of pharmacy change is quickening, with no slowdown in sight. We&rsquo;re here to help keep you informed, enhance the quality of your professional life, and to represent your interests and those of your patients.</p>\r\n\r\n<p>{% link_pg link , false , , , 7 , Joining NJPhA %} helps the entire pharmacy community by</p>\r\n\r\n<ul>\r\n\t<li>Advocating &ndash; on legislative and regulatory issues important to your practice and your patients</li>\r\n\t<li>Educating &ndash; you, your peers, and the public</li>\r\n\t<li>Communicating &ndash; create and share a rich library of industry news, best practices, and more</li>\r\n</ul>\r\n\r\n<p>Your {% link_pg link , false , , , 6 , benefits%} include early notification and discounts for continuing education programs sponsored by the Association and access to programs offered by APhA and other thought leaders. As a member ({%link_pg link, false , , , 11,student members%} included), you can nominate a peer or mentor for a {% link_pg link , false , , , 10 , service award%} to be presented at the Association&rsquo;s Annual Meeting and Convention.</p>\r\n\r\n<p>Help the entire pharmacy community in New Jersey<strong>. &nbsp;</strong>{% link_pg button, false, _self, btn-small, 7, Join today %}</p>\r\n\r\n<p>Members, and specifically the diversity of members, are the lifeblood of any Association, and that includes NJPhA, so&nbsp;<a href="mailto:njpha@njpharma.org?subject=Membership%20">tell us</a> what you value about your membership and what we can improve.</p>\r\n\r\n<p>Help us spread the word about the Association so we can p<span style="line-height: 1.6;">reserve the past, honor the present, and shape the future of Pharmacy in New Jersey.</span></p>\r\n	\N	2014-04-09 15:24:10.156365	2015-03-30 01:10:26.133761	2	t	t	f		f	f	NJPhA Membership	f
