7	Become a Member	become-a-member	\N	NJPHA membership, New Jersey Pharmacist, NJ pharmacist, pharmacist association	Joining NJPhA is fast and easy. Online registration takes only minutes. Membership provides discounts on continuing ed programs and access to member-only website content. 	<h1>Become an NJPhA Member</h1>\r\n\r\n<p>Welcome! &nbsp;We are so glad that you have decided to join us in advancing the profession of pharmacy, &nbsp;To become an NJPhA member, simply&nbsp;complete the form below.&nbsp;If you have any questions regarding registration, please contact the office at 609-275-4246.</p>\r\n\r\n<h2>Add a PAC contribution too</h2>\r\n\r\n<p>Please also consider adding a voluntary Polotical Action Committee (PAC) donation.&nbsp; If each member donated the suggested minimum amount of $15, our PAC would grow by several thousands annually.&nbsp; The amount is up to you!&nbsp; The field can be edited to any amount you feel you wish to invest in pharmacy.</p>\r\n\r\n<p><span style="font-size: 12px;"><em>*NJPhA dues are not deductible for income-tax purposes. They may be deductible as ordinary and necessary business expenses, subject to restrictions as a result of organization lobbying activities. NJPhA estimates that 19% is the nondeductible portion of your 2018&nbsp;dues.</em></span></p>\r\n\r\n<div class="membeeWrapper"><script src="http://memberservices.membee.com/feeds/Profile/ProfileScript.ashx?cid=955&pid=701" type="text/javascript"></script></div>\r\n\r\n<p><span style="font-size: 12px;"><em>**PAC contributions are not deductible for income tax purposes. Contributions to NJPhA PAC are voluntary and used for political purposes. You may refuse to contribute without reprisal, and the Association will not favor or disfavor any member because of the amount contributed.</em></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n	5	2014-04-09 18:10:41.3969	2018-01-23 19:09:59.780721	2	t	t	f		f	f	Join NJ Pharmacists Association	f
