r="0" scrolling="no" src="//www.facebook.com/plugins/likebox.php?href=https%3A%2F%2Fwww.facebook.com%2FNJPhA&amp;width=400&amp;height=250&amp;colorscheme=light&amp;show_faces=false&amp;header=false&amp;stream=true&amp;show_border=false&amp;appId=181996265257356" style="border:none; overflow:hidden; width:400px; height:250px;"></iframe></div>\r\n</div>\r\n\r\n<div class="col-xs-6" style="margin-top: 17px;">\r\n<div class="col-xs-12 home-right-panel col-centered">\r\n<h2>Legislation We Monitor</h2>\r\n\r\n<ul>\r\n\t<li>Prohibiting the sale of products containing dextromethorphan to persons under 18 years of age</li>\r\n\t<li>Requiring proof of ID when certain prescription medications are dispensed</li>\r\n\t<li>Permitting pharmacists to substitute a biosimilar biological product under certain circumstances&nbsp;</li>\r\n</ul>\r\n\r\n<p align="center">{% link_pg button, false, _self, btn-lg, 31, More Legislation News %}</p>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n	\N	2014-04-19 02:16:15.888196	2017-03-01 03:30:02.555052	0	f	f	f	/	f	t	Home Page New Jersey Pharmacists Association	f
