31	Advocacy and Legislation	advocacy	\N	Pharmacy legislation, pharmacy bills, pharmacy advocacy	See what NJPhA advocacy has accomplished with pharmacy legislation in New Jersey. Then see what pharmacy legislation is pending and being monitored by NJPhA.	<h2>Advocacy</h2>\r\n\r\n<p><span style="font-size:12px;"><span style="font-family:arial,helvetica,sans-serif;"><span style="line-height: 1.6;">Disease management. Medication dispensing. Reimbursement.</span></span></span></p>\r\n\r\n<p>These are just a few aspects of the pharmacy profession that are being debated, written into legislation, and voted on in the New Jersey legislature. Thanks to your support, NJPhA maintains an {% link_pg link , false , , , 32 , active political presence%} in our state capitol to monitor the discussions and represent the voice of pharmacists in New Jersey.</p>\r\n\r\n<p>But the converse also holds true. Without your moral, vocal, and financial support, advocacy isn&rsquo;t possible, so please {% link_pg link , false , , , 32 , make a contribution%} to the NJPhA Political Action Committee (PAC).</p>\r\n\r\n<p>Here&rsquo;s a sample of what NJPhA has done for New Jersey pharmacists and their patients.</p>\r\n\r\n<h2>NJPhA legislative achievements</h2>\r\n\r\n<ul>\r\n\t<li>Permitting properly qualified pharmacists to administer flu vaccine to pediatric patients<sup>1</sup></li>\r\n\t<li>Permitting qualified pharmacists to immunize patients 18 years and older for all types of immunizations<sup>2</sup></li>\r\n\t<li>Providing for collaborative practice between physicians and pharmacists</li>\r\n\t<li>Modernization of the practice of pharmacy to reflect the current training and education of pharmacists under the Pharmacy Practice Act</li>\r\n\t<li>Two laws providing for choice in selecting a pharmacy. Mandatory mail order is not permitted for New Jersey State regulated plans</li>\r\n\t<li>Enabling pharmacists to be reimbursed as diabetes educators</li>\r\n\t<li>Providing for pharmacy coupons to be used by senior citizens 62 years or older</li>\r\n\t<li>Providing for the prompt payment of prescription claims for New Jersey state-regulated health insurance plans</li>\r\n\t<li>Providing for limitations on the recoupment or recapture of payments for pharmacy claims for New Jersey state-regulated health insurance plans no more than 18 months from date of service</li>\r\n\t<li>Requiring all New Jersey insurance cards to indicate whether coverage is self-insured or insured</li>\r\n\t<li>Providing pharmacies with a mutually agreeable time for pharmacy audits by insurers</li>\r\n\t<li>Providing for uniformity in prescription benefits cards</li>\r\n\t<li>Establishing the Pharmaceutical Assistance to Aged and Disabled Program (PAAD) and Senior Gold (SG) Program</li>\r\n</ul>\r\n\r\n<p style="margin-left: 40px;"><sup>1 </sup>Patients aged 12-17 years by physician standing order, prescription or government programs and to patients 7-11 years of age by prescription</p>\r\n\r\n<p><sup>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; 2</sup> Pursuant to physician standing orders, prescriptions, or government sponsored programs</p>\r\n\r\n<hr />\r\n<h2>Upcoming pharmacy legislation</h2>\r\n\r\n<p>Here follows pharmacy legislation currently being debated in the Trenton legislature that NJPhA is monitoring closely. Click View Summary for a synopsis of the legislation. For complete information, click the bill number.</p>\r\n\r\n<hr />\r\n<p><strong><a href="http://www.njleg.state.nj.us/2014/Bills/A1000/622_I1.HTM">Bill A-622</a></strong>: Prohibits sale of Products containing Dextromethorphan to Persons under 18 Years of age</p>\r\n\r\n<p>{% sliding_div View Summary %}</p>\r\n\r\n<p>No person, either directly or indirectly by an agent or an employee, shall sell or offer to sell to a person under 18 years of age any product containing dextromethorphan.&nbsp;</p>\r\n\r\n<p>The establishment of all of the following shall constitute a defense to any prosecution brought pursuant of subsection a. A person, who violates the provisions of this bill, including an employee of a retail establishment who actually sells a product containing dextromethorphan to a person under 18 years of age, will be fined not more than $750. If the retail establishment is part of a chain with two or more locations in the State, the violation is to be assessed against the particular retail establishment and not the chain.</p>\r\n\r\n<p>{% endsliding_div %}</p>\r\n\r\n<hr />\r\n<p><a href="http://www.njleg.state.nj.us/2012/Bills/A0500/428_I1.HTM"><strong>Bill 689</strong></a>: Prohibits sale of products containing dextromethorphan to minors under 18 years of age</p>\r\n\r\n<p>{% sliding_div View Summary %}</p>\r\n\r\n<p>This bill would prohibit the sale of, or offer to sell, any product containing dextromethorphan to a person under 18 years of age. The purpose of the bill is to address the problem of abuse by teenagers of various over-the-counter cold remedies, which, when taken in sufficient doses, can produce hallucinogenic effects and have been reported to cause permanent brain damage, coma, and in some cases, death.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;A person who violates the provisions of this bill would be subject to a civil penalty of $250 for the first violation, $500 for the second violation, and $1,000 for the third and each subsequent violation. The penalties provided in the bill are the same as those provided for the sale of tobacco products to persons under 18 years of age under N.J.S.A.2A:170-51.4. The penalty is to be collected pursuant to the &quot;Penalty Enforcement Law of 1999,&quot; N.J.S.A.2A:58-10 et seq., in a summary proceeding before the municipal court having jurisdiction.</p>\r\n\r\n<p>{% endsliding_div %}</p>\r\n\r\n<hr />\r\n<p><a href="http://legiscan.com/NJ/text/A711/id/926734/New_Jersey-2014-A711-Introduced.html" style="line-height: 1.6;"><strong>Bill A-711</strong></a><span style="line-height: 1.6;">: Proof of ID for dispensation of certain prescription medications</span></p>\r\n\r\n<p>{% sliding_div View Summary %}</p>\r\n\r\n<p>This bill would require patients and their designated caregivers to provide a current and valid photo identification card when picking up prescriptions for narcotic medications, which include opium and opiates, opium and opiate derivatives, and certain stimulants.</p>\r\n\r\n<p>A designated caregiver would not be authorized to pick up a prescription for a narcotic drug on behalf of a patient unless the caregiver is at least 18 years of age, the patient identifies the caregiver at the time the prescription is issued, the practitioner issuing the prescription transmits the caregiver&rsquo;s name along with the prescription, and the caregiver&rsquo;s name appears on the prescription. In the case of a patient who is a minor, the patient&rsquo;s parent, resource family parent, or legal guardian would be identified as the designated caregiver except that, in the practitioner&rsquo;s discretion, another relative who is at least 18 years of age could be identified as the patient&rsquo;s designated caregiver.&nbsp;&nbsp;</p>\r\n\r\n<p>{% endsliding_div %}</p>\r\n\r\n<hr />\r\n<p><a href="http://www.njleg.state.nj.us/2014/Bills/A2500/2477_I1.HTM"><strong>Bill A-2477</strong></a><strong>: </strong>Biosimilars&nbsp;&ndash;&nbsp;Permits pharmacists to substitute a biosimilar biological product under certain circumstances</p>\r\n\r\n<p>{% sliding_div View Summary %}</p>\r\n\r\n<p>The &ldquo;Patient Protection and Affordable Care Act,&rdquo; Pub.L.111-148, amended the federal Public Health Service Act to create an abbreviated licensure pathway for biological products demonstrated to be biosimilar to, or interchangeable with, biological products licensed by the federal Food and Drug Administration (FDA). This bill allows for the substitution of these products by pharmacists, provided the conditions set forth in the bill are met.</p>\r\n\r\n<p>Specifically, the bill directs the Commissioner of Health to maintain, and make available to each pharmacy practice site in the State without charge, a list of biosimilar biological products approved by the FDA to be interchangeable with a prescribed biological reference product. A pharmacist may substitute such a product for a prescribed biological product if the prescriber has not indicated that there be no substitution by initialing the prescription blank next to &ldquo;do not substitute. A pharmacist who dispenses an interchangeable biosimilar product is to notify the patient in writing that the dispensed biological product has been approved by the FDA as an interchangeable biosimilar biological product, and notify the prescribing practitioner of the substitution within five business days after dispensing. The pharmacist is to record, on the prescription label and dispensing record, the product name of the interchangeable biosimilar biological product, followed by the words: &ldquo;Substituted for&rdquo; and the name of the biological reference product for which the prescription was written, as well as the manufacturer of the interchangeable biosimilar biological product. Records of substitutions are to be maintained for at least five years after the dispensing date.</p>\r\n\r\n<p>The bill provides immunity from liability for a pharmacist who makes such substitutions in compliance with the bill to the same extent that immunity would be provided for dispensing the prescribed biological reference product. The bill incorporates the definitions used in relevant federal law for the terms &ldquo;biological product,&rdquo; &ldquo;biosimilar,&rdquo; &ldquo;biological reference product,&rdquo; and &ldquo;interchangeable.&rdquo; Generally, &ldquo;biological products&rdquo; are made from various sources, including human, animal or microorganism, and are intended to treat medical conditions, or prevent or diagnose diseases. &ldquo;Biosimilar&rdquo; means that data show that a product is &ldquo;highly similar&rdquo; to an already-approved biological product. &ldquo;Reference product&rdquo; refers to the single biological product against which a biological product is evaluated in an application to be licensed as biosimilar or interchangeable. The bill also amends the definitions of &ldquo;drug&rdquo; in R.S.24:1-1 and &ldquo;drug product&rdquo; in section 5 of P.L.1977, c.240 (C.24:6E-4) to clarify that those terms do not include &ldquo;biological product.&rdquo; The bill takes effect on the first day of the second month next following the date of enactment.</p>\r\n\r\n<p>{% endsliding_div %}</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n	30	2014-04-10 15:11:53.545875	2016-08-19 16:39:31.183628	2	t	t	f		f	f	Pharmacy Advocacy & Legislation	f
10	Awards	awards	\N	Pharmacy award, pharmacist award	NJPhA members can nominate peers or colleagues to receive one of several awards that reflect their contribution to pharmacy in New Jersey. 	<h1>NJPhA Awards</h1>\r\n\r\n<p><span style="font-size:14px;">Who inspires you? A neighborhood pharmacist who donated medication to a family working through hard times?</span></p>\r\n\r\n<p><span style="font-size:14px;">A pharmacy school instructor who helped you master that topic you initially thought was impossible to comprehend?</span></p>\r\n\r\n<p><span style="font-size:14px;">An exemplary member of your region?&nbsp;</span></p>\r\n\r\n<p><span style="font-size:14px;">NJPhA provides <strong>members</strong> with an excellent way to thank <strong>fellow NJPhA members</strong>&mdash;who are your colleagues, friends, mentors&mdash;who made a difference in your career. Each year at the Annual Meeting and Convention, NJPhA recognizes <strong>member-nominated award recipients</strong> for their <strong>recent</strong>&nbsp;</span><span style="font-size: 14px;">contributions&nbsp;</span><span style="font-size: 14px;">(</span><span style="font-size: 14px;">within the last 2-3 years</span><span style="font-size: 14px;">) &nbsp;and achievements, separate from their job description. Award nominations are due by J</span><strong style="font-size: 14px;">une 15th each year.</strong><span style="font-size: 14px;">&nbsp; Any submissions received after June 15th will be considered the following year.</span></p>\r\n\r\n<p><span style="font-size:14px;">Few things are more gratifying than peer-recognition. Who will you nominate today?</span></p>\r\n\r\n<h2>The awards</h2>\r\n\r\n<table class="table table-bordered" height="3608" style="text-align: left;" width="731">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th style="width:217px">\r\n\t\t\t<h4 style="text-align: center;"><strong>Award Name</strong></h4>\r\n\t\t\t</th>\r\n\t\t\t<th style="width:422px">\r\n\t\t\t<h4 style="text-align: center;"><strong>Award Description</strong></h4>\r\n\t\t\t</th>\r\n\t\t\t<th style="width: 422px; text-align: center;">Recipients</th>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Rosario J. Mannino Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>This award honors President-Emeritus Rosario J. Mannino, and is given for meritorious service to the profession of pharmacy and the New Jersey Pharmacists Association.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Frank J. Cann, PhD, RPh</p>\r\n\r\n\t\t\t<p>2010 - Richard J. Weiss, RPh</p>\r\n\r\n\t\t\t<p>2011 - Loretta Brickman, RPh</p>\r\n\r\n\t\t\t<p>2013 - Sandra C. Moore, PharmD, CCP</p>\r\n\r\n\t\t\t<p>2014 - Ivan Saiff, RPh</p>\r\n\r\n\t\t\t<p>2016 - Louis Spinelli, RPh</p>\r\n\r\n\t\t\t<p>2017 - Linda Gooen, PharmD, MS, CGP, CCP</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Bowl of Hygeia<br />\r\n\t\t\t<span style="font-size:11px;">Sponsored by APhA Foundation and NASPA</span></p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Sponsored by National Alliance of State Pharmacy Associations (NASPA) to a living, NJ licensed pharmacist who has compiled an outstanding record of community service that, apart from the practice of pharmacy, reflects well on the profession.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Richard A. Palombo, RPh</p>\r\n\r\n\t\t\t<p>2010 - Richard J. Weiss, RPh</p>\r\n\r\n\t\t\t<p>2011 - Robert F. Kocsardy, RPh</p>\r\n\r\n\t\t\t<p>2013 - Eileen Fishman, RPh</p>\r\n\r\n\t\t\t<p>2014 - Maria Trocone Liebfried, BS, PharmD, BCNSP, CCP</p>\r\n\r\n\t\t\t<p>2015 - Edward McGinley, MBA, RPh</p>\r\n\r\n\t\t\t<p>2016 - Stephen Brickman, RPh</p>\r\n\r\n\t\t\t<p>2017 - Tom Bender, RPh</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="height: 77px; width: 217px;">\r\n\t\t\t<p>Andrew J. Preston Political Action Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="height: 77px; width: 422px;">\r\n\t\t\t<p>Sponsored by past President and PAC Chairman Andrew J. Preston, this award is presented to an NJPhA member exhibiting&nbsp; outstanding effort in the political arena to benefit the profession and our patients.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="height: 77px; width: 422px;">\r\n\t\t\t<p>2009 - Joseph P. Tarallo, Jr. RPh</p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2010 - Eileen B. Fishman, RPh</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2011 - Robert S. Milner, RPh</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2012 - Stephen Brandt, RPh</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2014 - Ritesh Shah, RPh</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2016 - Harold Bobrow, RPh</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2017 - Loretta Brickman, RPh</span></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Donald J. Wernik Academic Achievement Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Presented to an academician who has performed outstanding service for our profession&nbsp; and NJPhA.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Steven H. Zlotnick, PharmD</p>\r\n\r\n\t\t\t<p>2010 - John L. Colaizzi, Sr. PhD, RPh</p>\r\n\r\n\t\t\t<p>2011 - Frank S. Breve, PharmD, MBA, CCP</p>\r\n\r\n\t\t\t<p>2012 - Rupal Patel Mansukhani, PharmD</p>\r\n\r\n\t\t\t<p>2013 - Grace Earl, PharmD</p>\r\n\r\n\t\t\t<p>2014 - Timothy Nguyen, PharmD, BCPS</p>\r\n\r\n\t\t\t<p>2015 - Maria Trocone Liebfried, BS, PharmD, BCNSP, CCP</p>\r\n\r\n\t\t\t<p>2016 - Mary Bridgeman, PharmD, BCPS, CGP, FASCP</p>\r\n\r\n\t\t\t<p>2017 - John Colaizzi, Jr., PharmD, CCP</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Frederick B. Kilmer Award &nbsp;</p>\r\n\r\n\t\t\t<p>&nbsp;</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Dr. Kilmer, a former NJPhA president, established the concept of research at J&amp;J that became a standard for much of the pharmaceutical industry. He was a prodigious writer who valued articulate writing as a means of improving the pharmacy profession and the health of our citizenry.</p>\r\n\r\n\t\t\t<p>Though Dr. Kilmer&#39;s bequest to recognize excellence in pharmacy writing by a member was depleted many years ago,&nbsp; the award has been given since 1938.&nbsp; All members, with the exception of educators and laboratory workers, are eligible.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Francis J. Rodriguez, MS, CPhT</p>\r\n\r\n\t\t\t<p>2010 - Frank F. Pinchak, RPh</p>\r\n\r\n\t\t\t<p>2011 - Matthew J. Luckman, RPh</p>\r\n\r\n\t\t\t<p>2012 - Mary Bridgeman, PharmD, BCPS, CGP, FASCP</p>\r\n\r\n\t\t\t<p>2014 - John L. Colaizzi, Sr., PhD, RPh</p>\r\n\r\n\t\t\t<p>2015 - Carmela Silvestri, PharmD, CCP, FASCP</p>\r\n\r\n\t\t\t<p>2016 - Marcella Brown, BSPharm, MS, MPH, PharmD, CGP, BLSC, BCACP</p>\r\n\r\n\t\t\t<p>2017 - Steve Zlotnick, PharmD, CCP</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>NASPA Excellence in Innovation Award<br />\r\n\t\t\t<span style="font-size:11px;">Sponsored by Upsher-Smith</span></p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Sponsored by NASPA, this award is given to a practicing pharmacist within New Jersey who has demonstrated innovative pharmacy practice resulting in improved patient care.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Rupal Patel, PharmD</p>\r\n\r\n\t\t\t<p>2010 - Shara Rudner, BSPharm</p>\r\n\r\n\t\t\t<p>2011 - Mary M. Bridgeman, Pharm D, BCPS, CGP</p>\r\n\r\n\t\t\t<p>2012 - Lucio Volino, PharmD</p>\r\n\r\n\t\t\t<p>2013 - Anne Crochunis, PharmD</p>\r\n\r\n\t\t\t<p>2014 - James P. Cammarata, RPh</p>\r\n\r\n\t\t\t<p>2015 - Chester Lau, RPh, MS</p>\r\n\r\n\t\t\t<p>2016 -Loretta Brickman, RPh</p>\r\n\r\n\t\t\t<p>2017 - Domenic DiPrimo, RPh</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Jesse Gaynor Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p style="margin-left:4.5pt">Presented to a consultant pharmacist who has shown meritorious service and dedication to the practice of pharmacy.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Frank S. Breve, MBA, CCP</p>\r\n\r\n\t\t\t<p>2010 - J. Wesley Dawson, RPh, CCP</p>\r\n\r\n\t\t\t<p>2011 - Edward Rucki, RPh, CCP, CGP</p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2012 - Robert Fusco, RPh, CCP, FASCP</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2016 - Penny Applegate, RPh, CCP</span></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Mortar &amp; Pestle Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Authorized by the Board of Trustees, the Mortar &amp; Pestle Award is given to an individual who is not a pharmacist, but who by virtue of his or her activity, has contributed to the profession of pharmacy and the public-at-large.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Laurie A. Clark</p>\r\n\r\n\t\t\t<p>2010 - Pamela Mandel, Esq.</p>\r\n\r\n\t\t\t<p>2011 - Honorable Linda Stender, Assemblywoman District 22</p>\r\n\r\n\t\t\t<p>2012 - Commissioner Jennifer Velez, Esq.</p>\r\n\r\n\t\t\t<p>2013 - Senator James Whelan</p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2014 - Congressman Frank Pallone Jr.</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2015 - Michael Avaltroni, PhD</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2016 - Senator Linda Greenstein</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2017 - Assemblyman Raj Mukherji</span></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>William H. McNeill Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>This award recognizes outstanding community service work by an NJPhA member in the preceding year or years.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Peter J. Halecky, RPh</p>\r\n\r\n\t\t\t<p>2010 - Paul Schneider, RPh</p>\r\n\r\n\t\t\t<p>2011 - Joseph P. Tarallo, RPh</p>\r\n\r\n\t\t\t<p>2012 - John Surmay, RPh, HO</p>\r\n\r\n\t\t\t<p>2015 - Edward Rucki, RPh, CCP</p>\r\n\r\n\t\t\t<p>2016 - John L. Colaizzi, Jr., PharmD, CCP</p>\r\n\r\n\t\t\t<p>2017 - Richard Coniglio, RPh</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Pharmacist Mutual Distinguished Young Pharmacist Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Presented to an outstanding pharmacist who has worked for the profession of pharmacy and who graduated in the past ten years.&nbsp;</p>\r\n\r\n\t\t\t<p>This award is presented to a pharmacist who best meets the following guidelines:</p>\r\n\r\n\t\t\t<ul>\r\n\t\t\t\t<li>Licensed &amp; in good standing to practice in New Jersey</li>\r\n\t\t\t\t<li>Current membership &amp; participation in NJPhA</li>\r\n\t\t\t\t<li>Degree in Pharmacy received within the last ten years (2006 graduate or later)</li>\r\n\t\t\t\t<li>Participation in national pharmacy associations, professional programs, state association activities, and/or community service</li>\r\n\t\t\t</ul>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - John E. Berkenkopf, RPh, PharmD</p>\r\n\r\n\t\t\t<p>2010 - Ryan T. Barna, PharmD</p>\r\n\r\n\t\t\t<p>2011 - Chan Sohn, PharmD</p>\r\n\r\n\t\t\t<p>2012 - Lisa Lee, PharmD</p>\r\n\r\n\t\t\t<p>2013 - Moriah Weisman, PharmD, CCP</p>\r\n\r\n\t\t\t<p>2014 - Brian J. Catton, Pharm D</p>\r\n\r\n\t\t\t<p>2015 - Satish Poondi, RPh, Esq.</p>\r\n\r\n\t\t\t<p>2016 - Kristine Cigna, PharmD, CCP</p>\r\n\r\n\t\t\t<p>2017 - Michael Tinglin, PharmD</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Pharmaceutical Industry Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Presented to a representative of the pharmaceutical industry who has advanced the profession through educational efforts or support to the profession</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2009 - Dean Gregory Gianarkis, MS, PharmD</p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2010 - Larry F. Doud, III</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2011 - Steven H. Zlotnick, PharmD, CCP</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2012 - Carrie Corboy, RPh, PharmD, CCP</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2014 - Moriah J. Weissman, PharmD, CCP</span></p>\r\n\r\n\t\t\t<p><span style="line-height: 1.6;">2016 - Josseph Barone, PharmD, FCCP</span></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Independent Pharmacist of the Year Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>This award is presented to a practicing pharmacist who has demonstrated exemplary service to his/her patients and the community.</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>2010 - Ritesh Shah, RPh</p>\r\n\r\n\t\t\t<p>2011 - James Cammarata, RPh</p>\r\n\r\n\t\t\t<p>2012 - Vincent Marone, RPh</p>\r\n\r\n\t\t\t<p>2014 - Mark K. Taylor, FACVP</p>\r\n\r\n\t\t\t<p>2015 - Sandy Fishman, RPh</p>\r\n\r\n\t\t\t<p>2016 - David Miller, RPh</p>\r\n\r\n\t\t\t<p>2017 - John Bellitti, RPh</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style="width: 217px;">\r\n\t\t\t<p>Cardinal Health Generation Rx Champions Award</p>\r\n\t\t\t</td>\r\n\t\t\t<td style="width: 422px;">\r\n\t\t\t<p>Presented to a pharmacist in recognition of efforts to prevent prescription drug abuse, and for outstanding service to the pharmacy community to raise awareness of this serious public health problem.</p>\r\n\t\t\t</td>\r\n\t\t\t<t