89	March Madness	march-madness	\N			<h1>March Madness</h1>\r\n\r\n<p><img alt="" height="110" src="http://njpharmacists.org/ckeditor_assets/pictures/270/original_mm_logo.jpg" style="float: right;" width="230" />Make sure to mark your calendar for our March Madness event.&nbsp; March Madness provides pharmacists and pharmacy techinicians with the chance to earn up to 8 CE credits in a single day. Held annually at the College of St. Elizabeth in Morristown, NJ, attendees also have a unique opportunity to liaise with pharmacy industry product and service providers at their display stations in the Annunciation Center.&nbsp;</p>\r\n\r\n<p><span style="font-size:16px;">Registration is Now Open!!&nbsp;</span></p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large, http://njpharmacists.org/events#id=10331&amp;cid=955&amp;wid=201<span style="line-height: 1.6;">, Register&nbsp;%} &nbsp; &nbsp; &nbsp; </span></p>\r\n\r\n<h2>March 10, 2018</h2>\r\n\r\n<p>7 :00AM-8:00AM &nbsp; &nbsp; <strong>Registration and Continental Breakfast</strong></p>\r\n\r\n<p>8:00AM-10:00AM<b>&nbsp; &nbsp; &nbsp;No Bones About It: Updates on Osteoporosis 2018</b></p>\r\n\r\n<p><span style="font-family:adelle-sans,helvetica neue,sans-serif;"><span style="color: black;">Osteoporosis management continues to evolve, with updated&nbsp;treatment guidelines and practice statements clarifying the place in therapy and optimal use of drug treatment in the management of this condition. &nbsp;The availability of new medications and revision to treatment guidelines mandates that the pharmacy practitioner keep abreast of current evidence to ensure safe and optimal medication use and appropriate place in therapy of the agents available to treat this condition.</span></span><span style="font-family:&quot;Calibri&quot;,sans-serif;color:black"><o:p></o:p></span></p>\r\n\r\n<p><span class="eventspan">10:00AM-12:00PM<b>&nbsp; &nbsp;Pharmacy Compliance in The World of Government Oversight and Commercial Insurance Regulations</b></span></p>\r\n\r\n<p>Pharmacists benefit from an understanding of the requirements for participation in the various state Medicaid and federal Medicare prescription programs, including Fraud Waste and Abuse requirements as well as a basic review of the enforcement actions of the Drug Enforcement Administration on community pharmacists.</p>\r\n\r\n<p><span class="eventspan">12:00PM-1:00PM&nbsp; &nbsp; &nbsp;<b>Lunch</b></span></p>\r\n\r\n<p><span class="eventspan">1:00PM-3:00PM<b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Preventing Medication Errors in the Administration of Common Oral Inhaler Devices</b></span></p>\r\n\r\n<p><span class="eventspan">3:00PM-5:00PM<span style="white-space: pre;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <i> </i></span></span><strong>Assessing the Acne Patient: A Guide to OTC Acne Vulgaris Therapy for the Pharmacist&nbsp;&nbsp;​</strong></p>\r\n\r\n<p>This program is designed to give the practioner a complete overview of acne categories based on patient presentation and identify available OTC therapies. The goal of the program is to recognize the type of acne and individualize an OTC therapy to target the patient&rsquo;s acne needs. The secondary goal is to triage the patient to the dermatologist before acne scaring occurs.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>These activities are&nbsp;eligible for ACPE credit.&nbsp; See final ACPE activity announcement for specific details.</em></p>\r\n\r\n<p><em>*Schedule Subject to Change</em></p>\r\n	85	2016-08-27 16:05:00.457734	2018-02-15 19:44:00.176777	3	t	f	f		f	f		f
