16	Continuing Education	continuing-education	\N	NJPHA, pharmacy continuing ed 	Learn about NJPhA pharmacy continuing ed programs throughout the state. Education programs are designed for pharmacists, pharmacy technicians and students.	<h1>Continuing Education Programs</h1>\r\n\r\n<p><span style="font-size: 14px;">All aspects of pharmacy practice&mdash;medical, legal, and financial&mdash;are changing rapidly. To help you stay current, NJPhA is expanding your opportunity to enroll in credit-based and noncredit educational programs.</span></p>\r\n\r\n<p><span style="font-size: 14px;">You can attend NJPhA programs offered around the state throughout the year, or <a href="http://www.njpharmacists.org/continuing-education/CE-Calendar#cid=955&amp;wid=201">programs within your local NJPhA region or at any region throughout the state</a>. We&rsquo;ve also teamed with APhA to offer their {% link_pg link , false , , , 20 , certification programs%}. All these venues also provide great networking opportunities.</span></p>\r\n\r\n<p><span style="font-size: 14px;">If you can&rsquo;t travel to a meeting, live and pre-recorded {% link_pg link , false , , , 18 , webinars%} on a variety of topics will also be available soon, along with other {% link_pg link , false , , , 19 , home-study based programs&nbsp;%}.</span></p>\r\n\r\n<p><span style="font-size: 14px;">And to keep you on the leading edge, you can attend a specialty interest {% link_pg link , false , , , 21 , NJPhA Academy program%}. These groups are created by NJPhA members, so if you see an educational need not addressed by our programs, propose the creation of a new Academy.</span></p>\r\n	\N	2014-04-09 19:10:40.758429	2018-01-03 18:41:27.168598	4	t	t	f		f	f	Continuing Education Programs	f
