11	Student Chapter	student-chapter	\N	NJPHA, student, pharmacy student, student chapter	Pharmacy students can join the New Jersey Pharmacists Association at a greatly reduced rate, yet receive all the benefits of full membership. 	<h1>Pharmacy Students&nbsp;&ndash;&nbsp;Welcome!</h1>\r\n\r\n<p>You&rsquo;re the future of our profession, which is why NJPhA created a special, {% link_pg link , false , , , 7 , reduced-rate membership plan%} to get you involved in Association activities and {% link_pg link , false , , , 12 , networking with your peers %}.</p>\r\n\r\n<p>NJPhA believes in preserving the past, honoring the present, and shaping the future, so we&rsquo;re very pleased to be represented on campus at colleges and schools of pharmacy.</p>\r\n\r\n<ul>\r\n\t<li>Rutgers University &ndash; <a href="http://pharmacy.rutgers.edu/">Ernest Mario School of Pharmacy</a></li>\r\n\t<li><a href="http://www.fdu.edu/academic/pharmacy">Farleigh Dickinson University School of Pharmacy</a></li>\r\n\t<li>University of the Sciences in Philadelphia &ndash; <a href="http://www.usciences.edu/academics/collegesdepts/pharmpracticeadmin/pharmd">Philadelphia College of Pharmacy</a></li>\r\n\t<li><a href="http://www.temple.edu/pharmacy/" target="_blank">Temple University School of Pharmacy</a></li>\r\n\t<li>Saint John&rsquo;s University &ndash; <a href="http://www.stjohns.edu/academics/schools-and-colleges/college-pharmacy-and-health-sciences">College of Pharmacy and Health Sciences</a></li>\r\n\t<li>Long Island University Pharmacy - <a href="http://www.liunet.edu/Pharmacy">The Arnold and Marie Schwartz College of Pharmacy and Health Science at Long Island University</a>&nbsp;</li>\r\n\t<li>Thomas Jefferson University &ndash;<a href="http://www.jefferson.edu/university/pharmacy.html">Jefferson School of Pharmacy</a></li>\r\n</ul>\r\n\r\n<h2>Student rates, full-scale activities</h2>\r\n\r\n<p>Our student chapter locations introduce you to a community of pharmacy students who live in or plan to practice in New Jersey. Students are welcome at <strong>ALL</strong> NJPhA events, including {% link_pg link , false , , , 15 , Legislative Day %} in Trenton, {% link_pg link , false , , , 17 , regional meetings&nbsp;%}, {% link_pg link , false , , , 16 , continuing education activities%}, {% link_pg link , false , , , 14 , March Madness%} and the {% link_pg link , false , , , 13 , Annual Meeting and Convention%}. Student members can also submit articles for publication in New Jersey&rsquo;s peer-reviewed {% link_pg link , false , , , 24 , pharmacy journal%}.</p>\r\n\r\n<p>You&rsquo;ll also receive the pharmacy-student-generated newsletter, which highlights the student activities and programs throughout all the student chapters.</p>\r\n\r\n<p>Not a member? Student rates make it easy to {% link_pg link , false , , , 7 , join NJPhA %}.</p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large, 7, Join Now %}</p>\r\n	5	2014-04-09 18:47:33.150829	2015-03-27 18:15:57.605975	5	t	f	f		f	f	NJPHA Student Chapter	f
