85	Events	events	\N			<h1>NJPhA Events</h1>\r\n\r\n<p style="line-height: 20.8px;">If you&rsquo;re looking to obtain continuing education credits, meet local peers, or catch up on the status of pharmacy legislation that&rsquo;s circulating the hallways of Trenton, the Events Calendar (below) is a great place to start.</p>\r\n\r\n<p style="line-height: 20.8px;">The Calendar lists all the activities scheduled throughout the Association, including education programs, local meetings, and networking events.&nbsp; Come to an Association event&mdash;you&rsquo;ll be glad that you did.</p>\r\n\r\n<h2>Bring the event to you &ndash;&nbsp;home study</h2>\r\n\r\n<p style="line-height: 20.8px;">If your schedule has you too busy to attend a program, why not bring the program to you?</p>\r\n\r\n<p style="line-height: 20.8px;">In addition to what you see in the calendar below, NJPhA also povides an ever-expanding variety of programs available as online home studies.</p>\r\n\r\n<h2>Event Calendar</h2>\r\n<script src="http://memberservices.membee.com/feeds/Events/EventScript.ashx?cid=955&wid=201" type="text/javascript"></script>	\N	2016-08-19 18:35:30.341274	2017-02-16 17:02:39.930609	3	t	t	f		f	f		f
