97	Spring Fling	spring_fling	\N			<h1>Spring Fling</h1>\r\n\r\n<p><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/271/original_sf_logo.jpg" style="width: 300px; height: 116px; float: right;" />Make sure to mark your calendar for our Spring Fling event.&nbsp; Spring Fling provides pharmacists and pharmacy&nbsp;techinicians with the chance to earn up to seven CE credits in a single day!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large, http://njpharmacists.org/events#id=10332&amp;cid=955&amp;wid=201, Save The Date&nbsp;%} &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<h2>&nbsp; &nbsp; &nbsp;&nbsp;<br />\r\nSaturday April 14, 2018</h2>\r\n\r\n<p>7:00AM-8:00AM&nbsp; &nbsp; &nbsp;&nbsp;<strong>Continental Breakfast&nbsp;</strong></p>\r\n\r\n<p>8:00AM -10:00AM&nbsp; &nbsp; &nbsp;<b>Stroke Prevention: A New Hope</b></p>\r\n\r\n<p>10:00AM-12:00PM&nbsp; &nbsp; &nbsp;<b>Electronic Cigarettes: The Hidden Dangers of Vaping</b></p>\r\n\r\n<p>Electronic nicotine delivery systems (ENDS) are battery-powered devices used to electrically deliver nicotine to the user in the form of heated vapor. There have been a number of reported safety incidents which have led to hospitalizations due to thermal injuries. &nbsp;As these devices become more prevalent with the general public, it is important to understand the mechanisms for potential harm and the new legislation created to protect users. &nbsp;&nbsp;The purpose of this program is to increases knowledge of the harms of using such devices, current legislation in the United States, and how health care providers can educate their patients on alternative safer smoking cessation tools.</p>\r\n\r\n<p>12:00PM-1:00PM&nbsp; &nbsp; &nbsp; <strong>LUNCH</strong></p>\r\n\r\n<p>1:00PM-3:00PM&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>Preventing Prescription Drug Abuse</strong></p>\r\n\r\n<p>3:00PM-4:30PM&nbsp; &nbsp; &nbsp; <strong>Pharmacy Law</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>*These activities are eligible for ACPE credit;&nbsp;See final CPE activity announcement for specific details. &nbsp;</p>\r\n\r\n<p>* Schedule Subject to Change</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n	85	2017-02-09 16:54:13.997282	2018-02-14 16:47:55.674653	4	t	t	f		f	f		f
