4	Committees	committees	\N	NJPhA Committees, NJ pharmacy, nj pharmacist	Join an NJPhA committee helps the Association advance pharmacy in New Jersey. NJPhA committees also provide many networking opportunities in all branches of pharmacy.	<h1>NJPhA Committees</h1>\r\n\r\n<p>Nobody has to tell you that the pharmacy profession is changing at an ever-increasing rate, and to keep pace, NJPhA has to evolve. But for this to happen, we need input, advice, and guidance from members like you.</p>\r\n\r\n<h2>Helping your profession. And Yourself.</h2>\r\n\r\n<p>Participating in an NJPhA committee takes time, but the benefits are many&mdash;enhancing leadership skills, steering direction of the Association, networking, early awareness of industry trends, and guiding the actions to address them. On top of this is knowing that your efforts continue to make the Association relevant and meaningful to your colleagues and your profession today and into the future.</p>\r\n\r\n<p>To participate in a committee, contact one of the committee chairs below or <a href="mailto:njpha@njpharma.org?subject=Committee%20Question">get in touch with the NJPhA office</a>.</p>\r\n\r\n<h2>2017&nbsp;Committees</h2>\r\n\r\n<p><strong>Continuing Education</strong><br />\r\nRecommend and review {% link_pg link , false , , , 16 , educational program &nbsp;%} content<br />\r\nChair: <a href="mailto:linda_gooen@alumni.rutgers.edu">Linda Gooen</a>, PharmD, MS, CCP, CGP</p>\r\n\r\n<p><strong>Journal</strong><br />\r\nMaintain oversight of and provide advice to the editorial staff of {% link_pg link , false , , , 24 , <em>The New Jersey Journal of Pharmacy</em> %}&nbsp;<br />\r\nCo-Chairs: <a href="mailto:Marcella.r.brown@gmail.com?subject=NJPhA%20New%20Jersey%20Journal%20of%20Pharmacy">Marcella Brown</a>, BS, MS, PharmD, MPH and Julie Kalabalik, PharmD</p>\r\n\r\n<p><strong>Government and Public Affairs&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </strong>Review, track, and prioritize proposed {% link_pg link , false , , , 30 , legislation and regulatory proposals%}<br />\r\nCo-chairs: <a href="mailto:bd_consulting@hotmail.com?subject=Government%20and%20Public%20Affairs">Loretta Brickman</a>, RPh and <a href="mailto:haroldbobrowrp@gmail.com?subject=Government%20and%20Public%20Affairs">Harold Bobrow</a>, RPh</p>\r\n\r\n<p><strong>Finance</strong><br />\r\nProvide financial oversight of the organization<br />\r\nChair: <a href="mailto:john.colaizzi@walgreens.com">John Colaizzi Jr</a>, PharmD, CCP</p>\r\n\r\n<p><strong>Professional Affairs (Ad Hoc)</strong><br />\r\nReview professional issues affecting all areas of pharmacy practice<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Permanent Organization</strong><br />\r\nConsider all propositions related to the amendment of the Constitution and by-laws<br />\r\nChair: <a href="mailto:ccpconsu@aol.com">Steve Zlotnick</a>, PharmD, CCP</p>\r\n\r\n<p><strong>Membership</strong><br />\r\nGuide membership services, recruitment, and retention initiatives<br />\r\nChair: Mark Taylolr, RPh, MBA, FACVP</p>\r\n\r\n<p><strong>Convention</strong><br />\r\nPlan, organize, and execute the <a href="http://www.njpharmacists.org/events/annual-convention">Annual Meeting and Convention.</a><br />\r\nChair: James Ward, RPh</p>\r\n\r\n<p><strong>Student Practitioner</strong><br />\r\nIdentifies methods to strengthen {% link_pg link , false , , , 11 , Association relationships with pharmacy students &nbsp;%}<br />\r\nChair: <a href="mailto:leibfried2@hotmail.com">Maria Leibfried</a>,&nbsp;PharmD, CCP</p>\r\n\r\n<p><strong style="line-height: 20.8px;">New Practitioner</strong><br style="line-height: 20.8px;" />\r\n<span style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 22px;">Offers unique opportunities for professional development, education, advocacy and social networking for pharmacists in <a href="http://www.njpharmacists.org/membership/new_practitioner_network">New Practitioner Network (NPN)</a></span><br style="line-height: 20.8px;" />\r\n<span style="line-height: 20.8px;">Co-Chairs: Christine Lam, PharmD and Elif Ozdener, PharmD</span></p>\r\n\r\n<p><strong style="line-height: 20.8px;">Social</strong><br style="line-height: 20.8px;" />\r\n<span style="font-family: adelle-sans, helvetica, sans-serif; font-size: 14px; line-height: 22px;">Plans and excutes <a href="http://www.njpharmacists.org/events/tonic_events">+TONIC Rx</a> social and charity events a&nbsp;to build a better, stronger NJ pharmacy community</span><br style="line-height: 20.8px;" />\r\n<span style="line-height: 20.8px;">Chair:&nbsp;</span><a href="mailto:leibfried2@hotmail.com" style="line-height: 20.8px;">K</a><a href="mailto:Kncigna@gmail.com">ristine Cigna</a>, PharmD, CCP</p>\r\n	1	2014-04-09 15:21:07.95248	2018-01-03 20:19:31.100175	4	t	t	f		f	f	NJPhA Committees	f
20	Certificate Training Programs	certificate	\N	pharmacy continuing ed, pharmacy certification	Sign up for NJPhA and APhA pharmacy continuing ed certification programs. Topics cover a broad array of pharmacy areas and practice types. 	<h1>Certificate Programs</h1>\r\n\r\n<p>NJPhA offers several certificate training programs - 2 to 3 times each per year - across the state of NJ. NJPhA is the licensed provider of the American Pharmacists Associations (APhA) Certificate programs in New Jersey.&nbsp; Our organization also offers two proprietary certificate training programs - Preparing for a Consultant Pharmacist Career and Compounding Essentials. Not only do these programs enhance pharmacy expertise, but they also help to advance patient care.</p>\r\n\r\n<p>If you have questions, don&rsquo;t hesitate to <a href="mailto:njpha@njpharma.org?subject=APhA%20Certificate%20Programs">contact us</a> or the <a href="http://www.pharmacist.com/apha-accreditation-information">education office at APhA</a>.</p>\r\n\r\n<hr />\r\n<h2><span style="color:#800000;"><span style="font-size:20px;">Pharmacy-Based Immunization Delivery Certificate Training</span></span></h2>\r\n\r\n<p><strong>Date and Location:&nbsp; &nbsp;</strong>Saturday, March 10, 2018&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Annunciation Center, College of St. Elizabeth</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2 Convent Rd</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Morristown, NJ 07960</p>\r\n\r\n<p>{% link_pg button, false, _self, btn-large,http://www.njpharmacists.org/continuing-education/CE-Calendar#id=10339&amp;wid=201&amp;cid=955<span style="line-height: 1.6;"