24	Journal	journal	\N	New Jersey Journal of Pharmacy, New Jersey Pharmacy, Pharmacy journal	Access helpful pharmacy resources at njpha.org. NJPhA members can access the New Jersey Journal of Pharmacy online. 	<h1>The New Jersey Journal of Pharmacy</h1>\r\n\r\n<p>The quarterly Journal is the peer reviewed collection of timely information and insight created for pharmacists in all settings&mdash;community, hospital, consulting, and industry. Authored by peers, you can access valuable information thate goes beyond New Jersey borders.</p>\r\n\r\n<h2>Broad collection of pharmacy topics</h2>\r\n\r\n<p>You&rsquo;ll find information that features contemporary issues in disease management, details and feedback on new medication, continuing education activities, and a practice spotlight section that highlights successful, innovative practices and shares tips for reproducing their success.</p>\r\n\r\n<h2>In the current issue</h2>\r\n\r\n<p style="line-height: 20.8px;">Members can view Fall 2017 articles - and take FREE self-study CE - online after {% link_pg link , false , , , 33, logging in %}. If you&rsquo;re not a member, you can {% link_pg link , false , , , 7, join now&nbsp;%}.</p>\r\n\r\n<p style="line-height: 20.8px;">{% members_only %}</p>\r\n\r\n<p style="line-height: 20.8px;"><a href="http://njpharmacists.org/ckeditor_assets/attachments/308/34924_fall_2017_low-res.pdf">Fall 2017</a></p>\r\n\r\n<p><span style="line-height: 1.6;">{% endmembers_only %}</span></p>\r\n\r\n<h2>Member Momentum</h2>\r\n\r\n<p>NJPhA is pleased to bring its readers a new journal feature - Member Momentum. &nbsp;The now-regular column highlights recent industry recognition of our members - across &nbsp;all pracitce areas. It allows us the opportunity to recognize and congratualtie good work, postive practice models, major accomplishments and other personal achiemenets that show postivie MOMENTUM within pharmacy.</p>\r\n\r\n<p>Click&nbsp;<a href="http://www.njpharmacists.org/cpanel/member_momenta/new">here</a>&nbsp;to submit a Member Momentum &nbsp;item for yourself or a peer.</p>\r\n\r\n<h2>Submit an article</h2>\r\n\r\n<p>Have an idea for an article or a practice that you&#39;d like to spotlight? Please fill out the article submission form below and our editor will make certain to contact you.&nbsp; For detailed infomation on creating articles,&nbsp;<a href="http://njpharmacists.org/ckeditor_assets/attachments/110/njpha_the_nj_journal_of_pharmacy_author_guidelines.pdf">download the author and style guidelines</a>.</p>\r\n\r\n<p><span style="line-height: 18.9091px;">{% journal_articles_form %}</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Upcoming Journal Deadlines</h2>\r\n\r\n<p>Winter 2018&nbsp;- December 22, 2017</p>\r\n\r\n<p>Spring 2018&nbsp;- April 13, 2018</p>\r\n\r\n<p>Summer 2018&nbsp;- June 22, 2018</p>\r\n\r\n<p>Fall 2018&nbsp;- October 12, 2018</p>\r\n\r\n<p>Winter 2019&nbsp;-&nbsp; December 21, 2018&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<h2>Archived Journals</h2>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/302/summer_2017-final-lowres.pdf">Summer 2017</a></p>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/285/spring_2017_final.pdf">Spring 2017</a></p>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/274/winter_2017_low_res.pdf">Winter 2017</a></p>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/267/fall_2016_low_res.pdf">Fall 2016</a></p>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/259/summer_journal.pdf">Summer 2016</a></p>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/260/final_pdf_journal_small_file.pdf">Spring 2016</a></p>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/268/32557_winter_2016_low_res.pdf">Winter 2016</a></p>\r\n\r\n<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/168/fall_2015_final.pdf"