3	NJPhA Leadership	leadership	\N	NJPHA, New Jersey Pharmacist, Leadership, njpha leader	NJPhA seeks more leaders to help guide pharmacy continuing education, pharmacy advocacy and other programs for pharmacists, pharmacy technicians and the profession. 	<h1>NJPhA Leadership</h1>\r\n\r\n<p>There&rsquo;s a lot going on within the Association&mdash;broadening educational programming, strengthening ties with pharmacy schools in New Jersey and beyond, maximizing our {% link_pg link , false , , , 30 , effectiveness in Trenton%}, and more&mdash;and we&rsquo;ve tried to create a responsive leadership structure that rapidly disseminates information throughout the regions.</p>\r\n\r\n<p>The voice of the {% link_pg link , false , , , 2 , regions&nbsp;%}, {% link_pg link , false , , , 21, Academies%} and {% link_pg link , false , , , 4 , committees&nbsp;%} funnels through the Board of Trustees, whose members are responsible for relaying information back to these groups. Your CEO, Elise Barry, and a hard-working support team oversee daily operations of the Association and conceive short- and long-term strategy.</p>\r\n\r\n<h2>Leadership structure<br />\r\n&nbsp;</h2>\r\n\r\n<p><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/3/content_organizationstructure.png" style="width: 475px; height: 629px;" /></p>\r\n\r\n<h2>Talk to us</h2>\r\n\r\n<p>We don&rsquo;t have all the answers, but with your help, NJPhA leadership will know the important questions. Use the email links below to tell us what you think or what you need on any issue that matters to you and your patients. We very much want to hear from you.</p>\r\n\r\n<h2>Join us</h2>\r\n\r\n<p>NJPhA has a full slate of activities for 2018, but it takes minds and hands to get things done. {% link_pg link , false , , , 4 , Join a committee%}, apply for a trustee position, run for a regional line position, or take a lead role within an Academy. Your colleagues will help you learn the ropes&mdash;no experience necessary&mdash;only a desire to help better the lot of pharmacists and their patients.</p>\r\n\r\n<p>Not sure how to get started? Give the office a call (609-275-4246) and we wil be happy to connect you to any of our officers or trustees!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:24px;"><span style="color:#800000;">Line Officers</span></span></p>\r\n\r\n<p><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/81/original_rmannino.jpg" style="width: 200px; height: 171px;" /></p>\r\n\r\n<p>Past President and Chair of the Board of Trustees</p>\r\n\r\n<p>Ronald J. Mannino, RPh</p>\r\n\r\n<hr />\r\n<div class="col-xs-4">&nbsp;</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/314/original_carmela_2016.jpg" style="width: 200px; height: 199px;" /></p>\r\n\r\n<p><span style="line-height: 1.6;">President</span></p>\r\n\r\n<p>Carmela Silvestri, PharmD, CCP</p>\r\n\r\n<hr />\r\n<p><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/262/original_james_ward_2016.png" style="width: 162px; height: 170px;" /></p>\r\n\r\n<p>President-elect</p>\r\n\r\n<p>James F. Ward, RPh</p>\r\n\r\n<hr />\r\n<p><input alt="" src="http://njpharmacists.org/ckeditor_assets/attachments/312/taylor-photo.jpg" style="width: 162px; height: 258px;" type="image" /></p>\r\n\r\n<p>Vice President</p>\r\n\r\n<p>Mark Taylor RPh, MBS, FACVP&nbsp;</p>\r\n\r\n<hr />\r\n<p><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/20/content_john.jpg" style="line-height: 1.6; width: 125px; height: 187px;" /></p>\r\n\r\n<p><span style="line-height: 1.6;">Treasurer</span><span style="line-height: 1.6;">&nbsp;</span></p>\r\n\r\n<p>John Colaizzi, Jr. , PharmD, CCP</p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Board of Trustees</h2>\r\n\r\n<div class="row">\r\n<div class="col-xs-4">\r\n<p><strong>Region 1:</strong> Salvatore Peritore<br />\r\n<strong>Alternate:</strong><a href="mailto:njpha@njpharma.org?subject=L.%20Spinelli">&nbsp;</a>Lou Spinelli</p>\r\n\r\n<p><strong>Region 2: <a href="mailto:njpha@njpharma.org?subject=Attn%3A%20S.%20Zlotnick">&nbsp;</a></strong>Steve Zlotnick<br />\r\n<strong>Alternate:&nbsp;</strong>Henry Gialanella</p>\r\n\r\n<p><strong>Region 3:</strong> Adedolapo Ademodi-Gbogodo<br />\r\n<strong>Alternate:</strong><a href="mailto:njpha@njpharma.org?subject=Attn%3A%20C.Corboy"> </a>Carrie Corboy</p>\r\n</div>\r\n\r\n<div class="col-xs-4">\r\n<p><strong>Region 4:</strong> Tony Qi<br />\r\n<strong>Alternate:</strong>&nbsp; Ruth Marietta</p>\r\n\r\n<p><strong>Region 5:</strong> Mark Taylor<br />\r\n<strong>Alternate:</strong> Steve Chang</p>\r\n\r\n<p><strong>Region 6:</strong> Richard Kress<br />\r\n<strong>Alternate:</strong> Azuka Obianwu</p>\r\n</div>\r\n</div>\r\n\r\n<p><strong>Student Trustee:&nbsp; </strong>Rutgers: Daniel Chang<br />\r\n<strong>Alternate:&nbsp;&nbsp;</strong>Fairleigh Dickinson:&nbsp; Nitin Kumar</p>\r\n	1	2014-04-08 18:44:56.828842	2018-01-03 20:13:29.785172	3	t	t	f		f	f	NJPhA Leadership	f
25	Career Center	career-center	\N		Access helpful pharmacy resources at njpha.org. NJPhA members can access the NJPhA pharmacy career center online.	<h1>NJPhA Career Center</h1>\r\n\r\n<p>Hopefully you&rsquo;re satisfied and secure in your current role, but it&rsquo;s good to know that NJPhA members have a helpful resource should the time come for a career move. Make the NJPhA Career Center your first stop in the search for a new opportunity.</p>\r\n\r\n<p>You&rsquo;ll find a database of opportunities that can be searched by several criteria, eg, keyword, location, proximity, with the option to program searches that will automatically notify you with relevant opportunities.</p>\r\n\r\n<p>{% members_only %}</p>\r\n\r\n<p>{% link_pg button , false , _self, btn-mini, http://njpha.associationcareernetwork.com/Common/HomePage.aspx ,Start Your Search Now%}</p>\r\n\r\n<p>{% endmembers_only %}</p>\r\n\r\n<p>{% non_members_only %}</p>\r\n\r\n<p>Access to the Career Center requires NJPhA membership. If you&#39;re a member, &nbsp;just {% link_pg link , false , , , 33 , log in%} to begin your search. If you&rsquo;re not a member, you can {% link_pg link , false , , , 7 , join now%}.&nbsp;</p>\r\n\r\n<p>{% endnon_members_only %}</p>\r\n\r\n<p>&nbsp;</p>\r\n	23	2014-04-09 20:29:25.449003	2016-08-19 16:18:22.5728	3	f	f	f		f	f		f
21	Academies	academies	\N	NJPHA, pharmacy forum, pharmacy academy	Join an NJPhA Pharmacy Academy to learn best practices in key pharmacy areas. Academies exist for disaster management pharmacists, and for compounding and consultant pharmacists. 	<h1>Academies</h1>\r\n\r\n<p>NJPhA academies are your special-interest forums to learn about the latest issues affecting your patients and your practice.<br />\r\n<br />\r\n<em>Who can join them?</em> Pharmacists, technicians, and students who are NJPhA members in good standing.<br />\r\n<br />\r\n<em>Who proposes topics for new Academies?</em> YOU DO.<br />\r\n<br />\r\nIf you have a specialty area that you&#39;d like to see become an academy, just&nbsp;<a href="mailto:njpha@njpharma.org?subject=Academy%20Proposal">let us know</a>. And remember to share your idea with your colleagues and peers&mdash;Academies of at least 50 people earn a representative seat on the Board of Trustees.</p>\r\n\r\n<h2>How to join an Academy</h2>\r\n\r\n<p>You can join an academy by {% link_pg link , false , , , 33 , logging in%}, accessing your member profile, and selecting the desired Academies.</p>\r\n\r\n<h2>Academy of Disaster Management Pharmacists</h2>\r\n\r\n<p>The mission is to promote the health and safety of New Jersey residents by preparing pharmacists and pharmacy technicians to respond to naturally occurring disasters and outbreaks, chemical, biological, radiological, nuclear, and explosive events, and other health and homeland security threats and emergencies.</p>\r\n\r\n<h2>Academy of Compounding Pharmacists</h2>\r\n\r\n<p>This Academy&rsquo;s mission is to provide a forum for New Jersey Compounding Pharmacists to address certain specific key issues related to compounding and the protection of compounding in New Jersey.</p>\r\n\r\n<h2>Academy of Consultant Pharmacists</h2>\r\n\r\n<p>This Academy advances the discipline and practice of pharmacy consulting for the benefit of its members and the patients who they service. The objective is to provide members with resources to ensure clinical competency and regulatory awareness through the development and dissemination of professional knowledge.</p>\r\n	5	2014-04-09 20:20:46.83202	2016-08-19 16:41:13.598084	10	t	t	f		f	f	NJPhA Academies	f
32	NJPhA PAC 	njpha-pac	\N	pharmacy legislation, pharmacy political action, New Jersey pharmacy	Learn about the New Jersey Pharmacists Association Political Action Committee and their activities regarding pharmacy legislation in New Jersey. 	<h1>NJPhA Political Action Committee</h1>\r\n\r\n<p>The NJPhA Political Action Committee (PAC) is a voluntary, bipartisan voice that advances the interests of NJPhA members and pharmacy practice before the New Jersey Legislature. Its purpose is to establish pharmacy practice and pharmacists as a viable political force. To that end, NJPhA PAC has helped gain approval for many {% link_pg link , false , , , 31 , pharmacy-related legislative actions%} in the New Jersey Legislature.</p>\r\n\r\n<p>But NJPhA PAC doesn&rsquo;t stop there.</p>\r\n\r\n<h2>Service beyond pharmacy advocacy</h2>\r\n\r\n<p>In addition to building relationships with legislators, NJPhA PAC supports pharmacy educational and research objectives; teaches members about the legislative process; and sponsors {% link_pg link , false , , , 90&nbsp;, Legislative Day%}, an opportunity for NJPhA members to &nbsp;interact with legislators.</p>\r\n\r\n<h2>Effective advocacy costs money</h2>\r\n\r\n<p>We need your financial support.</p>\r\n\r\n<p>It&rsquo;s that simple.</p>\r\n\r\n<p>The sums need not be huge. For the cost of one movie theater ticket, you can help our profession grow and improve its future. Though $15 is the minimum suggested donation, you can edit the field to any amount you wish to invest in pharmacy.&nbsp;</p>\r\n\r\n<h2>How to donate</h2>\r\n\r\n<ul>\r\n\t<li>{% link_pg link , false , , , 34 , Donate online %}<a href="http://njpharmacists.org/events#id=106&amp;cid=955&amp;wid=201"><img alt="Header donation" src="http://www.njpharmacists.org/assets/header_donation-475ffe93ca818ff17cb5df6e0a53c6b4.png" style="float: right; height: 150px; width: 150px;" /></a></li>\r\n\t<li>Mail a check payable to NJPhA PAC to this address</li>\r\n</ul>\r\n\r\n<p style="margin-left:1.0in;">NJPhA PAC<br />\r\n760 Alexander Road, PO Box 1<br />\r\nPrinceton, NJ 08543-0001</p>\r\n\r\n<ul>\r\n\t<li>Schedule automatic contributions with a credit card\r\n\t<ul>\r\n\t\t<li>Please <a href="mailto:njpha@njpharma.org?subject=Donation">contact NJPhA</a>&nbsp;(609.275.4246) for details</li>\r\n\t</ul>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Please note that donations to NJPhA PAC are political contributions and are not deductible for income tax purposes.</p>\r\n	30	2014-04-10 15:15:22.630582	2017-03-15 15:37:31.727067	3	t	t	f		f	f	NJPhA Political Action Committee	f
