95	Renew Your Membership	renew-your-membership	\N			<h1>Renew Your Membership</h1>\r\n\r\n<p>Would you like to renew your membership? Terrific!&nbsp;Each year, the NJPhA emails renewal reminders - to all current members -&nbsp;just weeks before&nbsp;renewal date. &nbsp;To renew, simply&nbsp;open the email, click the link, and renew online.</p>\r\n\r\n<div>\r\n<p>If you believe that your&nbsp;membership is up for renewal soon, however,&nbsp;and you have not yet received an email from us, please&nbsp;call&nbsp;the office at 609-275-4246&nbsp;and an NJPhA staff member will forward&nbsp;an invoice to you.</p>\r\n\r\n<h2>Renewal in a few clicks</h2>\r\n\r\n<p>Of course, you can always click <span style="font-size:16px;"><strong><a href="http://www.njpharmacists.org/home/ebilling">here</a></strong></span> to log onto our secure server to view and pay your renewal invoice. Use this link, too, to pay any and all outstanding&nbsp;fees associated with your membership. When the page opens, click the Global ebilling link in the upper left corner of the screen to access your ebilling&nbsp;account.</p>\r\n\r\n<p>And good news... NJPhA has activated Card Vault. By storing credit card information on our secure server, you can now renew your membership, and register for events, on the fly!&nbsp;Check out the new Card Vault option on the payment processing page when you click online to pay your invoice. You can even select an automatic renewal option so that your membership is paid on time, in full at each renewal.</p>\r\n\r\n<h2>Lapsed membership?</h2>\r\n\r\n<p>Members who wish to update their memberships&nbsp;after a lapsed period are, once again, encouraged to call the NJPhA office. Alternatively, you can <a href="http://www.njpharmacists.org/membership/become-a-member">complete a new member registration online</a>. &nbsp;But take special note that&nbsp;all newly-inputted information will overwrite the previously-stored information in your membership profile.</p>\r\n</div>\r\n	5	2017-01-05 18:14:22.321942	2017-03-08 20:04:44.958482	3	t	t	f		f	f		f
2	Regional Organization	regional-organization	\N	NJPhA, org chart, NJPhA organization, NJPhA region	Learn about the regional organization of NJPhA and how it benefits pharmacists, pharmacy technicians, and the patients whom they serve.	<h1>NJPhA Regional Organization</h1>\r\n\r\n<p>NJPhA is organized into 6 geographic regions that host {% link_pg link , false , , , 16 , continuing education%} programs and networking events, and communicate Association and industry news discussed by {% link_pg link , false , , , 3 , NJPhA leadership &nbsp;%}&mdash; the Board of Trustees, the CEO, and line officers. We organized locally to minimize your travel and to make it easeir for you to have maximum input on the issues and the activities most relevant to where you practice.</p>\r\n\r\n<p>But as usual, the sum of the parts is greater than the whole, so leadership works with regions to ensure that one very strong, unified voice {% link_pg link , false , , , 30 , represents you and your patients&nbsp;%} in Trenton and beyond.</p>\r\n\r\n<h2>Look beyond your NJPhA region</h2>\r\n\r\n<p>There&rsquo;s nothing stopping you from participating in activities hosted by regions other than yours. With over 10 regional education programs during 2017&nbsp;and more planned for this year, we hope that you&rsquo;ll {% link_pg link , false , , , 30 , see what activities are going on%} in regions outside of your home base.</p>\r\n\r\n<h2>Find your region</h2>\r\n\r\n<p>You can use the map below to identfy your region based on the county where you live.</p>\r\n\r\n<p><img alt="" src="http://njpharmacists.org/ckeditor_assets/pictures/2/content_nj_map.jpg" style="width: 427px; height: 632px;" /></p>\r\n	1	2014-04-08 18:35:38.61216	2017-12-29 15:43:50.964812	2	t	t	f		f	f	NJPhA Regional Organization	f
1	About	about	\N	About NJPhA, NJPhA, new jersey pharmacists association 	The New Jersey Pharmacists Association (NJPHA) advances the profession of pharmacy through education and advocacy to help members provide optimal care to those they serve.	<h1>About Us</h1>\r\n\r\n<p>It&rsquo;s not about us. NJPhA is about <strong>you</strong> and your <strong>patients</strong>.<br />\r\n<br />\r\nEstablished in 1870 as The New Jersey Pharmaceutical Association and renamed the New Jersey Pharmacists Association (NJPhA) in 1996, the Association&rsquo;s mission is to advance the profession of pharmacy, enabling our members to provide optimal care to those they serve.</p>\r\n\r\n<h2>How the NJPhA works for you</h2>\r\n\r\n<ul>\r\n\t<li><strong>Advocate</strong>&nbsp;&nbsp;<br />\r\n\tWe work at all levels of government to protect the interest of you and your patients, <em>including </em>state and federal legal representation</li>\r\n\t<li><strong>Educate</strong> &nbsp;<br />\r\n\tWe organize local Continuing Education programs and identify other training opportunities to keep you informed and your skills current</li>\r\n\t<li><strong>Communicate&nbsp;</strong><br />\r\n\tNJPhA shares a rich collection of technical and career resources, including the online version of the <em>New Jersey Journal of Pharmacy</em></li>\r\n</ul>\r\n\r\n<h2>A legacy of pharmacy leadership</h2>\r\n\r\n<p>NJPhA was one of the first state pharmacy associations to affiliate with the American Pharmacists Association (APhA), and 4 NJPhA presidents eventually went on to lead APhA.* If you&rsquo;re a member, consider {% link_pg link , false , , , 3 , taking on a leadership role %} or {% link_pg link , false , , , 4 , join a committee %}. If you&rsquo;re not a member, {% link_pg link , false , , , 7, join today %}.</p>\r\n\r\n<p>Without an active membership, it will be difficult for NJPhA to impact the growing list of challenges that your practice and patients face today and need to prepare for tomorrow.</p>\r\n\r\n<p><span style="font-size:12px;"><em>*George Beringer, Jr., Charles Holzhauzer, Charles Holton and Robert Fischelis</em></span></p>\r\n	\N	2014-04-08 18:26:07.174209	2015-03-27 18:02:50.653527	1	t	t	f		f	f	About	f
98	Student Newsletter Spring 2017	student_newsletter_spring_2017	\N			<p><a href="http://njpharmacists.org/ckeditor_assets/attachments/277/njpha_student_practitioner_newsletter_spring_2017_final_ls_edits.pdf">http://njpharmacists.org/ckeditor_assets/attachments/277/njpha_student_practitioner_newsletter_spring_2017_final_ls_edits.pdf</a></p>\r\n	23	2017-04-02 15:43:12.693433	2017-09-13 15:11:06.337198	0	f	f	f		f	f		f
27	Annual Report	annual-report	\N	NJPhA Annual Report	Visit NJPhA.org to access several types of pharmacy and healthcare resources. Members can access the Annual Report of the New Jersey Pharmacists Association.  	<h1>Annual Report</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>{% members_only %}</p>\r\n\r\n<p>2017 was a busy and productive year for NJPhA and it&rsquo;s members.&nbsp;<a href="http://njpharmacists.org/ckeditor_assets/attachments/305/annual_meeting-conv_2017_ceo_report_-101317.pdf">Download the Annual Report</a>&nbsp;to learn what NJPhA accomplished and what plans and objectives are in store for 2018.</p>\r\n\r\n<p>{% endmembers_only %}</p>\r\n\r\n<p>{% non_members_only %} 2017&nbsp;was a busy and productive year for NJPhA and it&rsquo;s members. NJPhA members may download the annual report after they {% link_pg link , false , , , 33 , log in%}. If you&#39;re not a member, you can {% link_pg link , false , , , 7 , join now%} and then access the report.</p>\r\n\r\n<p>{% endnon_members_only %}</p>\r\n	23	2014-04-09 20:41:26.033499	2017-11-16 18:45:49.563349	5	t	t	f		f	f	Annual Report	f
60	New Practitioner Network	new_practitioner_network	\N			<h1>New Practioner Network&nbsp;</h1>\r\n\r\n<p><span style="line-height: 1.6;">NJPhA&rsquo;s New Practitioner Network (NPN) welcomes all pharmacists who have graduated in the past 7 years and who are currently licensed in the state of New Jersey.&nbsp; NPN&rsquo;s mission is to uphold the legacy and traditions of pharmacy while empowering New Jersey pharmacists to advocate for the future of pharmacy and advance patient care both statewide and on a national level.</span></p>\r\n\r\n<h2>What is in it for me?</h2>\r\n\r\n<p>We are so glad you asked.&nbsp; NJPhA&rsquo;s NPN offers new practitioners with many opportunities for professional development, education, advocacy and social networking.&nbsp; Benefits include:</p>\r\n\r\n<ul>\r\n\t<li>Participating in NPN&rsquo;s mentorship program that pairs new practitioners with currently practicing pharmacists</li>\r\n\t<li>Acting as a mentor to a current pharmacy student in attendance at a local university</li>\r\n\t<li>Joining one of many NJPhA committees</li>\r\n\t<li>Authoring articles or serving as a Peer Reviewer for the <em>NJ Journal of Pharmacy</em></li>\r\n\t<li>Enjoying member discounts at all of NJPhA&rsquo;s continuing education programs including March Madness</li>\r\n\t<li>Impacting legislation in Trenton, &nbsp;NJ, in conjunction with NJPhA&rsquo;s legislative committee</li>\r\n\t<li>Raising awareness in support of important bills at Legislative Day and other statewide events</li>\r\n\t<li>Attending social and networking events including +TONIC Rx and the NPN Reception at NJPhA&rsquo;s Annual Convention</li>\r\n\t<li>Communicating your own subject matter expertise and successes through NPN&rsquo;s social media presence</li>\r\n</ul>\r\n\r\n<h2>Interested in participating in a mentorship program?</h2>\r\n\r\n<ul style="line-height: 20.8px;">\r\n\t<li><strong>Student mentorship program:</strong>&nbsp;pairing new practitioners with final-year pharmacy students. &nbsp;NJPhA members interested in being a mentor, please <span style="color:#008080;"><strong>click</strong>&nbsp;</span><strong><a href="http://goo.gl/forms/jJQcmPQOV0"><span style="color:#008080;">here</span></a>.</strong> &nbsp;Mentees, please <span style="color:#008080;"><strong>click</strong>&nbsp;</span><strong><a href="http://goo.gl/forms/ibIpdHVPNt"><span style="color:#008080;">here</span></a></strong>.</li>\r\n\t<li><strong>Member mentorship program:</strong>&nbsp;pairing seasoned NJPhA members with new practitioner members. NJPhA members interested in being a mentor or mentee, please <strong><span style="color:#008080;">click&nbsp;</span><a href="http://goo.gl/forms/4l958GXOSL"><span style="color:#008080;">here</span></a></strong>.</li>\r\n</ul>\r\n\r\n<h2>Meet some NPN members, witness their accomplishments, and hear what they are saying.</h2>\r\n\r\n<p><strong>Brian Catton, PharmD.&nbsp;</strong> Mr. Catton founded the NJPhA&rsquo;s NPN. In 2014, he was awarded NJPhA&rsquo;s Pharmacists Mutual Distinguished Young Pharmacist Award.&nbsp; He frequently authors articles for PharmPsych.com.&nbsp; <a href="https://pharmpsych.com/2014/11/11/from-sb-1180-to-abc-map-act-the-antietam-of-pennsylvanias-war-on-drug/">Read his latest article.</a></p>\r\n\r\n<h2>Join Today</h2>\r\n\r\n<p><span aria-hidden="true" style="font: italic 100 300px/normal adelle-sans, serif; margin: 0px; padding: 0px; left: -999px; top: -999px; width: auto; height: auto; display: block; white-space: nowrap; position: absolute; font-size-adjust: none; font-stretch: normal;">BESbswy</span><span aria-hidden="true" style="font: italic 100 300px/normal adelle-sans, sans-serif; margin: 0px; padding: 0px; left: -999px; top: -999px; width: auto; height: auto; display: block; white-space: nowrap; position: absolute; font-size-adjust: none; font-stretch: normal;">BESbswy</span><span aria-hidden="true" style="font: italic 300 300px/normal adelle-sans, serif; margin: 0px; padding: 0px; left: -999